if((select true from com_documento where resultado_migracion is not null limit 1))then raise notice 'fin'; select json_agg(json_build_object( 'id', t.iddocumento, 'obserror', t.obserror, 'es_con_migracion', t.es_con_migracion, 'resultado_migracion', t.resultado_migracion, 'obserrorcan',t.obserrorcan, -- KMM - 08-04-2025 - pdi-261 'resultadocan_migracion',resultadocan_migracion --KMM - 08-04-2025 - pdi-261 ))::text from com_documento t into resultado; return; end if;
--3. generar registros if(ptipo='VENTA')then perform com_importar_ventas_principal(); -- Crear funcion... elsif(ptipo='COMPR')then perform com_importar_compras_principal(); -- Crear funcion... end if;
--3.1 Test.. (Eliminar cuando las funciones anteriores (2) ya esten creadas) ---------update com_documento set obserror='Test Habilitado '||iddocumento, resultado_migracion=2;
--4. Informe de importacion select json_agg(json_build_object( 'id', t.iddocumento, 'obserror', t.obserror, 'es_con_migracion', t.es_con_migracion, 'resultado_migracion', t.resultado_migracion, 'obserrorcan',t.obserrorcan, --KMM - 08-04-2025 - pdi-261 'resultadocan_migracion',resultadocan_migracion --KMM - 08-04-2025 - pdi-261 ))::text from com_documento t into resultado;
