declare a_json json; begin -- 0. Truncar tabla truncate table com_producto; a_json = pjson::json; -- 1. Importar datos INSERT INTO com_producto( idproducto, ccod_empresa, ccodfamg, cdesfamg, ccodfamf, cdesfamf, ccodprod, cdesprod, cdesprodgen, ccodtes, ccodmar, cdesmar, ccodmed, ccodums, ccodcatbs, cdescatbs, ntipoprod, nunidsec, npesoprod, ccodbarras, ninprod, nanuprod, nlote, nseruni, nicbper, nprodanti, ngasrela, nprodsafniif, ccomcue, cvencue, cdebicue, ccredcue, cdebicuei, ccredcuei, ccodcos, ccodcos2, ccodpresu, ccomprod, cvenprod, ccodisc, cmoneda, npreunit1, npreunit2, npreunit3, npreunit4, npreunit5, npreunit6, npreunit7, npreunit8, npreunit9, npreunit10, npreunit11, npreunit12, npreunit13, npreunit14, npreunit15, nstockmin, nstockmax, nrango1, nrango2, nresp, ccodpps, ccodpds, nagemonmin, ccodlabora, cdeslabora, estado, en_ambiente_de, es_con_migracion, ccodcos3 ) select idproducto, ccod_empresa, coalesce(REGEXP_REPLACE(ccodfamg, '^\s+|\s+$', '', 'g'), ''), coalesce(REGEXP_REPLACE(cdesfamg, '^\s+|\s+$', '', 'g'), ''), coalesce(REGEXP_REPLACE(ccodfamf, '^\s+|\s+$', '', 'g'), ''), coalesce(REGEXP_REPLACE(cdesfamf, '^\s+|\s+$', '', 'g'), ''), coalesce(REGEXP_REPLACE(ccodprod, '^\s+|\s+$', '', 'g'), ''), coalesce(REGEXP_REPLACE(cdesprod, '^\s+|\s+$', '', 'g'), ''), coalesce(REGEXP_REPLACE(cdesprodgen, '^\s+|\s+$', '', 'g'), ''), lpad(coalesce(REGEXP_REPLACE(ccodtes, '^\s+|\s+$', '', 'g'), ''), 2, '0'), coalesce(REGEXP_REPLACE(ccodmar, '^\s+|\s+$', '', 'g'), ''), coalesce(REGEXP_REPLACE(cdesmar, '^\s+|\s+$', '', 'g'), ''), coalesce(REGEXP_REPLACE(ccodmed, '^\s+|\s+$', '', 'g'), ''), coalesce(REGEXP_REPLACE(ccodums, '^\s+|\s+$', '', 'g'), ''), coalesce(REGEXP_REPLACE(ccodcatbs, '^\s+|\s+$', '', 'g'), ''), coalesce(REGEXP_REPLACE(cdescatbs, '^\s+|\s+$', '', 'g'), ''), coalesce(REGEXP_REPLACE(ntipoprod, '^\s+|\s+$', '', 'g'), ''), coalesce(REGEXP_REPLACE(nunidsec, '^\s+|\s+$', '', 'g'), ''), coalesce(npesoprod, 0.00), coalesce(REGEXP_REPLACE(ccodbarras, '^\s+|\s+$