CREATE OR REPLACE FUNCTION func_guardar_com_producto_principal() RETURNS void AS $BODY$ declare rw record; rwalm record; -- kmm - 22-04-2024 begin -- 0. validaciones drop table if exists temp_cte_dato; create temp table temp_cte_dato ( ccod character varying(255), cdes character varying(255) );
for rw in select cper from cg_emppro order by cper loop UPDATE public.cc_productosc SET ccomcue =t.ccomcue, cvencue=t.cvencue from ( select rw.cper, p.ccodprod, p.ccodtes, p.ccomcue, p.cvencue from com_producto p inner join cc_productosc on p.ccodprod=cc_productosc.ccodprod and cc_productosc.cper=rw.cper and p.es_con_migracion=0) as t where cc_productosc.ccodprod=t.ccodprod and cc_productosc.cper=rw.cper ;
end loop;
------ ventas ------- for rw in select cper from cg_emppro order by cper loop update com_producto Set resultado_migracion=2, obserror = coalesce(obserror, '')||'- Cta de Venta en Producto no existe.' where com_producto.idproducto in ( select com_producto.idproducto from com_producto Inner join cf_plan on trim(com_producto.cvencue)=trim(cf_plan.ccodcue) and cf_plan.cper=rw.cper AND cf_plan.ccodcue<> NULL); end loop;
------ compras ------- for rw in select cper from cg_emppro order by cper loop update com_producto Set resultado_migracion=2, obserror = coalesce(obserror, '')||'- Cta de Compras en Producto no existe.' where com_producto.idproducto in ( select com_producto.idproducto from com_producto inner join cf_plan on trim(com_producto.ccomcue)=trim(cf_plan.ccodcue) and cf_plan.cper=rw.cper AND cf_plan.ccodcue<> NULL); end loop;
for rw in select cper from cg_emppro order by cper loop UPDATE public.cc_productosc SET ccomcue =t.ccomcue, cvencue=t.cvencue from ( select rw.cper, p.ccodprod, p.ccodtes, p.ccomcue, p.cvencue from com_producto p inner join cc_productosc on p.ccodprod=cc_productosc.ccodprod and cc_productosc.cper=rw.cper and p.es_con_migracion=0) as t where cc_productosc.ccodprod=t.ccodprod and cc_productosc.cper=rw.cper ;
end loop;
-- 1. Grupo: Mismo codigo diferente nombre update com_producto x set resultado_migracion=2, obserror = coalesce(obserror, '')||'- Código de grupo se ha espcificado más de 1 vez con diferente descripción ' from ( select cp.ccodfamg from com_producto cp where cp.ccodfamg<>'' group by cp.ccodfamg having count(distinct cp.cdesfamg) > 1 )t where x.ccodfamg = t.ccodfamg;
-- 2. Familia: Mismo codigo diferente nombre update com_producto x set resultado_migracion=2, obserror = coalesce(obserror, '')||'- Código de familia se ha espcificado más de 1 vez con diferente descripción ' from ( select cp.ccodfamf from com_producto cp where cp.ccodfamf<>'' group by cp.ccodfamf having count(distinct cp.cdesfamf) > 1 )t where x.ccodfamf = t.ccodfamf;
-- 3. Marca: Mismo codigo diferente nombre update com_producto x set resultado_migracion=2, obserror = coalesce(obserror, '')||'- Código de marca se ha espcificado más de 1 vez con diferente descripción ' from ( select cp.ccodmar from com_producto cp where cp.ccodmar<>'' group by cp.ccodmar having count(distinct cp.cdesmar) > 1 ) t where x.ccodmar = t.ccodmar;
-- 4. Unidad de medida SUNAT no existe -- update com_producto x -- set resultado_migracion=2, -- obserror = coalesce(obserror, '')||'- Unidad de medida de SUNAT no es válida ' -- from ( -- select cp.ccodums -- from com_producto cp -- left join cg_umsunat cu on cp.ccodums=cu.ccodums -- where cu.ccodums is null -- ) t -- where x.ccodums=t.ccodums;
-- 5. OSE: Mismo codigo diferente nombre update com_producto x set resultado_migracion=2, obserror = coalesce(obserror, '')||'- Código de OSCE se ha espcificado más de 1 vez con diferente descripción ' from ( select cp.ccodcatbs from com_producto cp where cp.ccodcatbs<>'' group by cp.ccodcatbs having count(distinct cp.cdescatbs) > 1 ) t where x.ccodcatbs = t.ccodcatbs;
