--1. Grupo truncate table temp_cte_dato; insert into temp_cte_dato(ccod, cdes) select distinct cp.ccodfamg, cp.cdesfamg from com_producto cp left join cc_familia t on cp.ccodfamg=t.ccodfam where cp.ccodfamg<>'' and t.ccodfam is null;
if(found)then --1. Validar update com_producto x set resultado_migracion=2, obserror = coalesce(obserror, '')||'- Descripción de grupo no puede ser vacía ' from temp_cte_dato t where x.ccodfamg=t.ccod and trim(t.cdes)=''; --2. Registrar insert into cc_familia(ccodfam, cdesfam, cnivfam) select t.ccod, t.cdes, 1 from temp_cte_dato t where trim(t.cdes)<>''; end if;
