if(found)then --1. Validar update com_producto x set resultado_migracion=2, obserror = coalesce(obserror, '')||'- Descripción de marca no puede ser vacía ' from temp_cte_dato t where x.ccodmar=t.ccod and trim(t.cdes)=''; --2. Registrar insert into cc_marca(ccodmar, cdesmar) select t.ccod, t.cdes from temp_cte_dato t where trim(t.cdes)<>''; end if;
-- 5. OSCE cg_catbbss truncate table temp_cte_dato; insert into temp_cte_dato(ccod, cdes) select distinct cp.ccodcatbs, cp.cdescatbs from com_producto cp left join cg_catbbss t on cp.ccodcatbs=t.ccodcatbs where cp.ccodcatbs<>'' and t.ccodcatbs is null;
if(found)then --1. Validar update com_producto x set resultado_migracion=2, obserror = coalesce(obserror, '')||'- Descripción de marca no puede ser vacía ' from temp_cte_dato t where x.ccodcatbs=t.ccod and trim(t.cdes)=''; --2. Registrar insert into cg_catbbss(ccodcatbs, cdescatbs) select t.ccod, t.cdes from temp_cte_dato t where trim(t.cdes)<>''; end if;
-- 6. Laboratorio cc_laboratorio truncate table temp_cte_dato; insert into temp_cte_dato(ccod, cdes) select distinct cp.ccodlabora, cp.cdeslabora from com_producto cp left join cc_laboratorio t on cp.ccodlabora=t.ccodlabora where cp.ccodlabora<>'' and t.ccodlabora is null;
if(found)then --1. Validar update com_producto x set resultado_migracion=2, obserror = coalesce(obserror, '')||'- Descripción de laboratorio no puede ser vacía ' from temp_cte_dato t where x.ccodlabora=t.ccod and trim(t.cdes)=''; --2. Registrar insert into cc_laboratorio(ccodlabora, cdeslabora) select t.ccod, t.cdes from temp_cte_dato t where trim(t.cdes)<>''; end if;
-- 0. Excluir ya registrados
for rw in select cper from cg_emppro order by cper loop
update com_producto x set resultado_migracion=1, obserror = 'Ya registrado' from ( select cp.ccodprod, rw.cper from com_producto cp join cc_productos ccp on cp.ccodprod=ccp.ccodprod join cc_productosc ccpc on ccp.ccodprod=ccpc.ccodprod and ccpc.cper=rw.cper )t where x.ccodprod = t.ccodprod and resultado_migracion<>2;
end loop; -- 1. productos INSERT INTO public.cc_productos( ccodprod, cdesprod, ccodmed, ccodcatbs, ccodfam, ccodmar, ngasrela, nunidsec, ninprod, nanuprod, nlote, nseruni, ntipoprod, npesoprod, ccodbarras, npreunit1, npreunit2, npreunit3, npreunit4, npreunit5, npreunit6, npreunit7, npreunit8, npreunit9, npreunit10, npreunit11, npreunit12, npreunit13, npreunit14, npreunit15, nstockmin, nstockmax, nrango1, nrango2, nresp, ccodpds, ccodpps, nagemonmin, mdsc, nprodcontrol, ccodlabora, npvdoris, npvdorid, ccodarancel, nprodsafniif, nicbper, cpdf, nprodanti, cmoneda, nprccomision, cdesprodgen, nflgkit, ffechainiciokit, ffechafinkit, ccoduniadic, nflgbarra ) select p.ccodprod, p.cdesprod, p.ccodmed, p.ccodcatbs, p.ccodfamf, p.ccodmar, case when lower(p.ngasrela)='si' then 1 else 0 end, case when lower(p.nunidsec)='si' then 1 else 0 end, case when lower(p.ninprod)='si' then 1 else 0 end, case when lower(p.nanuprod)='si' then 1 else 0 end, case when lower(p.nlote)='si' then 1 else 0 end, case when lower(p.nseruni)='si' then 1 else 0 end, case when lower(p.ntipoprod)='bien' then 1 else 2 end, p.npesoprod, p.ccodbarras, p.npreunit1, p.npreunit2, p.npreunit3, p.npreunit4, p.npreunit5, p.npreunit6, p.npreunit7, p.npreunit8, p.npreunit9, p.npreunit10, p.npreunit11, p.npreunit12, p.npreunit13, p.npreunit14, p.npreunit15, p.nstockmin, p.nstockmax, p.nrango1, p.nrango2, p.nresp, p.ccodpds, p.ccodpps, p.nagemonmin, '', 0, p.ccodlabora, 0, 0, '', case when lower(p.nprodsafniif)='si' then 1 else 0 end, case when lower(p.nicbper)='si' then 1 else 0 end, '', case when lower(p.nprodanti)='si' then 1 else 0 end, p.cmoneda, 0, p.cdesprodgen, 0, null, null, 0, case when p.ccodbarras is not null then 1 else 0 end from com_producto p left join cc_productos cp on p.ccodprod=cp.ccodprod where resultado_migracion is null and cp.ccodprod is null;
for rw in select cper from cg_emppro order by cper loop
-- 2. productosc --select * from cc_productosc INSERT INTO public.cc_productosc( cper, ccodprod, ccodtes, ccomcue, cvencue, cdebicue, ccredcue, ccodcos, ccodcos2, ccodpresu, ccomprod, cvenprod, ccodisc, cdebicuei, ccredcuei -- cdebicuets, ccredcuets, cdebicueti, ccredcueti -- sin datos ) select rw.cper, p.ccodprod, p.ccodtes, p.ccomcue, p.cvencue, p.cdebicue, p.ccredcue, p.ccodcos, p.ccodcos2, p.ccodpresu, coalesce(p.ccomprod, '1'), coalesce(p.cvenprod, '1'), p.ccodisc, p.cdebicuei, p.ccredcuei from com_producto p left join cc_productosc cp on p.ccodprod=cp.ccodprod and cp.cper=rw.cper where resultado_migracion is null and cp.ccodprod is null;
-- kmm - 22-04-2024 -- 2. productosc --select * from cc_productosc} for rwalm in select ccodalma from cc_almacen order by ccodalma LOOP INSERT INTO cc_productoss( cper, ccodprod, ccodalma) select rw.cper, p.ccodprod, rwalm.ccodalma from com_producto p left join cc_productoss cp on p.ccodprod=cp.ccodprod and cp.cper=rw.cper and cp.ccodalma = rwalm.ccodalma where p.resultado_migracion is null and cp.ccodprod is null; end LOOP; -- kmm - 22-04-2024
end loop;
-- Confirmacion update com_producto set resultado_migracion=1 where resultado_migracion is null;
end; $BODY$ LANGUAGE plpgsql VOLATILE COST 100; ALTER FUNCTION func_guardar_com_producto_principal() OWNER TO postgres;

CREATE OR REPLACE FUNCTION public.com_importar_compras_principal( ) RETURNS integer
AS $BODY$ DECLARE vnIdreg integer; vnnidlote integer; vnntc numeric(10,2); vncper char(4); vrwStk record; vrwAsi record; vrlote record; /* select * from com_importar_compras_principal() */ BEGIN vnIdreg := (SELECT coalesce((MAX(cc_Registro.nIdReg)+ 1),1) As nIdReg FROM cc_Registro);
--- NOTAS DE CREDITO y DEBITO Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' No puede esta vacio la ref.doc. NC o ND'), resultado_migracion = 2 where coalesce(crefdoc,'')='' and ccoddoc in('07','08') and es_con_migracion=0;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' No puede esta vacio crefser para NC o ND'), resultado_migracion = 2 where coalesce(crefser,'')='' and ccoddoc in('07','08') and es_con_migracion=0;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' No puede esta vacio crefnum para NC o ND'), resultado_migracion = 2 where coalesce(crefnum,'')='' and ccoddoc in('07','08') and es_con_migracion=0;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' No puede esta vacio cmotinc para NC o ND'), resultado_migracion = 2 where coalesce(cmotinc,'')='' and ccoddoc in('07','08') and es_con_migracion=0;
