Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' Codigo de ubigeo no existe'), resultado_migracion = 2 where es_con_migracion=0 and com_documento.ccodubi not in (select ccodubi from cc_ubigeo);
Insert into cg_entitrib (ccodruc,crazsoc, ctipdoc,CNATJUR,cdirec,ccodubi,cdepfin,cprovfin,cdistfin ) select DISTINCT ccodruc,crazsoc,ccodtipent as ctipdoc,case when ccodtipent='1' and Length(ltrim(ccodruc))=8 then '1' when ccodtipent='6' and Length(ltrim(ccodruc))=11 AND SUBSTRING(ltrim(ccodruc),1,2)='10' then '1' when ccodtipent='6' and Length(ltrim(ccodruc))=11 AND SUBSTRING(ltrim(ccodruc),1,2)='20' then '2' when ccodtipent='0' and Length(ltrim(ccodruc))<=15 then '3' when ccodtipent='7' and Length(ltrim(ccodruc))=12 then '1' when ccodtipent='4' and Length(ltrim(ccodruc))=12 then '1' when ccodtipent='4' and Length(ltrim(ccodruc))<11 then '3' END ::CHAR(1) AS CNATJUR,cdirecc,com_documento.ccodubi,cc_ubigeo.cdesubi as cdepfin,b.cdesubi as cprovfin, c.cdesubi as cdistfin FROM com_documento inner join cc_ubigeo on concat(substr(com_documento.ccodubi,1,2),'0000')=cc_ubigeo.ccodubi inner join cc_ubigeo b on concat(substr(com_documento.ccodubi,1,4),'00')=b.ccodubi inner join cc_ubigeo c on com_documento.ccodubi=c.ccodubi WHERE ccodruc not in (select ccodruc from cg_entitrib); ----select * from cg_entitribll insert into cg_entitribll(ccodruc,ccodcontac,ccontitulo,ccontnomb,cdirec) select distinct ccodruc,coalesce(ccodcontac,'') as ccodcontac ,coalesce(cdescontacto,'') as ccontitulo, coalesce(cdescontacto,'') as ccontnomb,coalesce(cdirecc,'') as cdirec from com_documento where ccodruc not in (select ccodruc from cg_entitribll);
-- Cargar la tabla cc_productoss stock insert into cc_productoss (cper, ccodalma, ccodprod) select com_documento.cper, a.ccodalma, a.ccodprod from com_detalledocumento a inner join com_documento using(iddocumento) inner join cc_productos using(ccodprod) left join cc_productoss ps on com_documento.cper=ps.cper and a.ccodalma = ps.ccodalma and a.ccodprod = ps.ccodprod where cc_productos.ntipoprod = 1 and trim(coalesce(ps.cper,'')) = '';
