-- VALIDACIONES DE LA CABECERA -- cper, ccoddoc, cserie,cnumero,ccodruc -- PK en compras Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' error no tiene monto total'), resultado_migracion = 2 where coalesce(ntot,0)=0 and es_con_migracion=0;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' error no tiene ruc'), resultado_migracion = 2 where coalesce(ccodruc,'')='' and es_con_migracion=0;
-- Validar codigo de ubigeo Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' Codigo de ubigeo no existe'), resultado_migracion = 2 where es_con_migracion=0 and com_documento.ccodubi not in (select ccodubi from cc_ubigeo);
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' Codigo de ubigeo no debe estar vacio'), resultado_migracion = 2 where es_con_migracion=0 and coalesce(com_documento.ccodubi,'')='';
-- Validar si el documento ya existe Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' Documento ya fue procesado anteriormente'), resultado_migracion = 2 where iddocumento in (select a.iddocumento From com_documento a inner join cc_registro c on a.cper=c.cper and a.ccoddoc=c.ccoddoc and a.cserie=c.cserie and a.cnumero =c.cnumero and a.ccodruc=c.ccodruc where a.es_con_migracion=0);
