-- Validar el lote exista para el producto Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' codigo de lote no existe'), resultado_migracion = 2 where es_con_migracion=0 and iddocumento in ( select iddocumento from com_detalledocumento inner join com_documento using(iddocumento) inner join cc_productos using(ccodprod) where cc_productos.nlote = 1 and CONCAT(com_documento.cper,com_detalledocumento.ccodalma, com_detalledocumento.ccodprod,com_detalledocumento.ccodlote) not in (select CONCAT(cper,ccodalma,ccodprod,ccodlote) from cc_productoslote));
