Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' Fecha de Venc.de lote no puede estar vacia'), resultado_migracion = 2 where es_con_migracion=0 and iddocumento in (select iddocumento from com_detalledocumento where coalesce(ccodlote,'')<>'' and coalesce(to_char(ffecvenlote,'yyyymmdd'),'')='');
