SELECT VARPER as cper, -- VARPER VARMES as cmes , -- VARMES VARORI AS ccodori, -- VARORI VARMAX + R.NASIENTO AS NASIENTO, R.NIDLIN AS NIDLIN, ------ CAMBIAR EN EL SELECT CON UN INNER JOIN R.NTIPCAM AS NTC, VARPERC AS CCODCUE, (CASE WHEN indicador = 'VENTA' THEN (CASE WHEN R.NIMPPERC < 0 THEN ABS(R.NIMPPERC) ELSE 0.00 END) ELSE (CASE WHEN R.NIMPPERC < 0 THEN 0.00 ELSE ABS(R.NIMPPERC) END) END ) AS NDEBE, (CASE WHEN indicador = 'VENTA' THEN (CASE WHEN R.NIMPPERC >= 0 THEN ABS(R.NIMPPERC) ELSE 0.00 END) ELSE (CASE WHEN R.NIMPPERC >= 0 THEN 0.00 ELSE ABS(R.NIMPPERC) END) END ) AS NHABER, R.CGLOSA, (CASE WHEN indicador = 'VENTA' THEN (CASE WHEN R.CMONCAN = 'S' THEN (CASE WHEN R.NIMPPERC < 0 THEN ABS(R.NIMPPERC) ELSE 0.00 END) ELSE (CASE WHEN R.NIMPPERC < 0 THEN ABS(ROUND(R.NIMPPERC*R.NTIPCAM,2)) ELSE 0.00 END) END) ELSE (CASE WHEN R.CMONCAN = 'S' THEN (CASE WHEN R.NIMPPERC < 0 THEN 0.00 ELSE ABS(R.NIMPPERC) END) ELSE (CASE WHEN R.NIMPPERC < 0 THEN 0.00 ELSE ABS(ROUND(R.NIMPPERC*R.NTIPCAM,2)) END) END) END ) AS NDEBES, (CASE WHEN indicador = 'VENTA' THEN (CASE WHEN R.CMONCAN = 'S' THEN (CASE WHEN R.NIMPPERC >= 0 THEN ABS(R.NIMPPERC) ELSE 0.00 END) ELSE (CASE WHEN R.NIMPPERC >= 0 THEN ABS(ROUND(R.NIMPPERC*R.NTIPCAM,2)) ELSE 0.00 END) END) ELSE (CASE WHEN R.CMONCAN = 'S' THEN (CASE WHEN R.NIMPPERC >= 0 THEN 0.00 ELSE ABS(R.NIMPPERC) END) ELSE (CASE WHEN R.NIMPPERC >= 0 THEN 0.00 ELSE ABS(ROUND(R.NIMPPERC*R.NTIPCAM,2)) END) END) END) AS NHABERS, (CASE WHEN indicador = 'VENTA' THEN (CASE WHEN R.CMONCAN = 'D' THEN (CASE WHEN R.NIMPPERC < 0 THEN ABS(R.NIMPPERC) ELSE 0.00 END) ELSE (CASE WHEN R.NIMPPERC < 0 THEN ABS(ROUND(R.NIMPPERC/R.NTIPCAM,2)) ELSE 0.00 END) END) ELSE (CASE WHEN R.CMONCAN = 'D' THEN (CASE WHEN R.NIMPPERC < 0 THEN 0.00 ELSE ABS(R.NIMPPERC) END) ELSE (CASE WHEN R.NIMPPERC < 0 THEN 0.00 ELSE ABS(ROUND(R.NIMPPERC/R.NTIPCAM,2)) END) END) END) AS NDEBED, (CASE WHEN indicador = 'VENTA' THEN (CASE WHEN R.CMONCAN = 'D' THEN (CASE WHEN R.NIMPPERC >= 0 THEN ABS(R.NIMPPERC) ELSE 0.00 END) ELSE (CASE WHEN R.NIMPPERC >= 0 THEN ABS(ROUND(R.NIMPPERC/R.NTIPCAM,2)) ELSE 0.00 END) END) ELSE (CASE WHEN R.CMONCAN = 'D' THEN (CASE WHEN R.NIMPPERC >= 0 THEN 0.00 ELSE ABS(R.NIMPPERC) END) ELSE (CASE WHEN R.NIMPPERC >= 0 THEN 0.00 ELSE ABS(ROUND(R.NIMPPERC/R.NTIPCAM,2)) END) END)
END ) AS NHABERD, 0 AS NCOMP, R.CCODDOC, R.CSERIE, R.CNUMERO, ' ' AS CNUMFIN, R.FFECHADOC, R.CCODRUC, R.CCODENTI, R.FFECHAVEN, ' ' AS CCODFLU, ' ' AS CCODPAGO, ' ' AS CCODCOS, ' ' AS CCODCOS2, R.cmoncan AS CMREG, -- cp_4406 anr 02/02/2024 -- ' ' AS CMREG, CAST(NULL AS DATE) AS FFEC_DC, '' AS CDOC_DC, '' AS CSER_DC, '' AS CNUM_DC, R.CMONCAN AS CMONEDA, R.FFECHACAN, 0 AS NRESP, ' ' AS CCODPPS, 0 AS NPERDENRE, 0 AS NPORRE, CAST(NULL AS DATE) AS FFECRE, ' ' AS CSERRE, ' ' AS CNUMRE, 0 AS NTCRE, 0 AS NBASERES, 0 AS NBASERED, 0 AS NIMPRES, 0 AS NIMPRED FROM ( select X.NASIENTO, --- HAY QUE SACAR EL TIPO DE CAMBIO SEGUN LA CUENTA ******* ESTO DEBE VENIR DESDE EL FOX ROW_NUMBER () OVER (PARTITION BY I.FFECHACAN,I.CDOCCAN,I.CSERCAN,I.CNUMCAN,I.CCUECAN,I.CMONCAN,I.NIMPORCAN ORDER BY I.FFECHACAN) + W.NIDLIN AS NIDLIN, I.ffechacan,I.cdoccan,I.csercan,I.cnumcan,I.ccuecan,I.cmoncan,I.nimporcan,I.ntipcam,I.ccodpago,I.ccoddoc,I.cserie,I.cnumero,I.ffechadoc,I.ffechaven,I.ccodenti,I.ccodruc,I.crazsoc,I.nimportes, I.nimported,I.ccodcue,I.cglosa,I.ccodcos,I.ccodcos2,I.nporre,I.nimpperc,I.nperdenre,I.cserre,I.cnumre,I.ffecre,I.idcobranzapago, LPAD(I.CSERIE,20,'0') AS CSERIEA, LPAD(I.CNUMERO,20,'0') AS CNUMEROA from com_cobranzapago_integra I INNER JOIN (SELECT *,ROW_NUMBER () OVER (ORDER BY FFECHACAN,CDOCCAN,CSERCAN,CNUMCAN,CCUECAN,CMONCAN,NIMPORCAN) AS NASIENTO FROM (SELECT DISTINCT FFECHACAN,CDOCCAN,CSERCAN,CNUMCAN,CCUECAN,CMONCAN,NIMPORCAN from com_cobranzapago_integra) U ) X ON I.FFECHACAN = X.FFECHACAN AND I.CDOCCAN = X.CDOCCAN AND I.CSERCAN = X.CSERCAN AND I.CNUMCAN = X.CNUMCAN AND I.CCUECAN = X.CCUECAN AND I.CMONCAN = X.CMONCAN AND I.NIMPORCAN = X.NIMPORCAN INNER JOIN (SELECT NASIENTO, MAX(NIDLIN) AS NIDLIN FROM RESULTADO GROUP BY NASIENTO) W ON X.NASIENTO+VARMAX = W.NASIENTO WHERE I.NIMPPERC <>0 ) AS R ORDER BY CPER, CMES, CCODORI, NASIENTO, NIDLIN ;
INSERT INTO RESULTADO (cper,cmes,ccodori,nasiento,nidlin,ntc,ccodcue,ndebe,nhaber,cglosa,ndebes,nhabers,ndebed,nhaberd,cdes,cdestino,ndifauto,ncomp, ccoddoc,cserie,cnumero,cnumfin,ffechadoc,ccodruc,ccodenti,ffechaven,ccodflu,ccodpago,ccodcos,ccodcos2, cmreg,ffec_dc,cdoc_dc,cser_dc,cnum_dc,cmoneda,FFECHACAN,NRESP,CCODPPS,NPERDENRE,NPORRE,FFECRE,CSERRE, CNUMRE,NTCRE,NBASERES,NBASERED,NIMPRES,NIMPRED) SELECT R.CPER, R.CMES, R.CCODORI, R.NASIENTO AS NASIENTO, D.NIDLIN, 0 AS NTC, D.CTADIF AS CCODCUE, 0 AS NDEBE, 0 AS NHABER, 'AJUSTE POR DIFERENCIA DE CAMBIO' AS CGLOSA, CASE WHEN R.CMONEDA = 'D' THEN (CASE WHEN D.DIF1S < 0 THEN ABS(D.DIF1S) ELSE 0 END) ELSE 0 END AS NDEBES, CASE WHEN R.CMONEDA = 'D' THEN (CASE WHEN D.DIF1S > 0 THEN ABS(D.DIF1S) ELSE 0 END) ELSE 0 END AS NHABERS, CASE WHEN R.CMONEDA = 'S' THEN (CASE WHEN D.DIF1D < 0 THEN ABS(D.DIF1D) ELSE 0 END) ELSE 0 END AS NDEBED, CASE WHEN R.CMONEDA = 'S' THEN (CASE WHEN D.DIF1D > 0 THEN ABS(D.DIF1D) ELSE 0 END) ELSE 0 END AS NHABERD, ' ' AS cdes, '001' AS cdestino, 1 AS NDIFAUTO, 0 AS NCOMP, '' AS CCODDOC, '' AS CSERIE, '' AS CNUMERO, '' AS CNUMFIN, CAST(NULL AS DATE) AS FFECHADOC, '' AS CCODRUC, '' AS CCODENTI, CAST(NULL AS DATE) AS FFECHAVEN, '' AS CCODFLU, '' AS CCODPAGO, '' AS CCODCOS, '' AS CCODCOS2, '' AS CMREG, CAST(NULL AS DATE) AS FFEC_DC, '' AS CDOC_DC, '' AS CSER_DC, '' AS CNUM_DC, R.CMONEDA, R.FFECHACAN, 0 AS NRESP, ' ' AS CCODPPS, 0 AS NPERDENRE, 0 AS NPORRE, CAST(NULL AS DATE) AS FFECRE, ' ' AS CSERRE, ' ' AS CNUMRE, 0 AS NTCRE, 0 AS NBASERES, 0 AS NBASERED, 0 AS NIMPRES, 0 AS NIMPRED FROM RESULTADO R INNER JOIN (SELECT CPER,CMES,CCODORI,NASIENTO, SUM(NDEBE-NHABER) AS DIF1, SUM(NDEBES-NHABERS) AS DIF1S, SUM(NDEBED-NHABERD) AS DIF1D, MAX(NIDLIN)+1 AS NIDLIN, (CASE WHEN SUM(NDEBED-NHABERD) + SUM(NDEBES-NHABERS)>0 THEN vardifg ELSE VARDIFP END) AS CTADIF -------------------------------------- VARDIFG -- VARDIFP FROM RESULTADO GROUP BY CPER,CMES,CCODORI,NASIENTO HAVING SUM(NDEBES-NHABERS) <> 0 OR SUM(NDEBED-NHABERD) <> 0 ) AS D ON R.CPER = D.CPER AND R.CMES = D.CMES AND R.CCODORI = D.CCODORI AND R.NASIENTO = D.NASIENTO AND R.NIDLIN = D.NIDLIN-1
UNION ---************* EL DESTINO SELECT R.CPER, R.CMES, R.CCODORI, R.NASIENTO AS NASIENTO, D.NIDLIN + 1 AS NIDLIN, 0 AS NTC, VARDIFPD AS CCODCUE, ---- VARDIFPD 0 AS NDEBE, 0 AS NHABER, 'AJUSTE POR DIFERENCIA DE CAMBIO' AS CGLOSA, CASE WHEN R.CMONEDA = 'D' THEN (CASE WHEN D.DIF1S < 0 THEN ABS(D.DIF1S) ELSE 0 END) ELSE 0 END AS NDEBES, CASE WHEN R.CMONEDA = 'D' THEN (CASE WHEN D.DIF1S > 0 THEN ABS(D.DIF1S) ELSE 0 END) ELSE 0 END AS NHABERS, CASE WHEN R.CMONEDA = 'S' THEN (CASE WHEN D.DIF1D < 0 THEN ABS(D.DIF1D) ELSE 0 END) ELSE 0 END AS NDEBED, CASE WHEN R.CMONEDA = 'S' THEN (CASE WHEN D.DIF1D > 0 THEN ABS(D.DIF1D) ELSE 0 END) ELSE 0 END AS NHABERD, 'S' AS cdes, '001' AS cdestino, 0 AS NDIFAUTO, 0 AS NCOMP, '' AS CCODDOC, '' AS CSERIE, '' AS CNUMERO, '' AS CNUMFIN, CAST(NULL AS DATE) AS FFECHADOC, '' AS CCODRUC, '' AS CCODENTI, CAST(NULL AS DATE) AS FFECHAVEN, '' AS CCODFLU, '' AS CCODPAGO, '' AS CCODCOS, '' AS CCODCOS2, '' AS CMREG, CAST(NULL AS DATE) AS FFEC_DC, '' AS CDOC_DC, '' AS CSER_DC, '' AS CNUM_DC, R.CMONEDA, R.FFECHACAN, 0 AS NRESP, ' ' AS CCODPPS, 0 AS NPERDENRE, 0 AS NPORRE, CAST(NULL AS DATE) AS FFECRE, ' ' AS CSERRE, ' ' AS CNUMRE, 0 AS NTCRE, 0 AS NBASERES, 0 AS NBASERED, 0 AS NIMPRES, 0 AS NIMPRED FROM RESULTADO R INNER JOIN (SELECT CPER,CMES,CCODORI,NASIENTO, SUM(NDEBE-NHABER) AS DIF1, SUM(NDEBES-NHABERS) AS DIF1S, SUM(NDEBED-NHABERD) AS DIF1D, MAX(NIDLIN)+1 AS NIDLIN, (CASE WHEN SUM(NDEBED-NHABERD) + SUM(NDEBES-NHABERS)>0 THEN VARDIFG ELSE VARDIFP END) AS CTADIF --- VARDIFG -- VARDIFP FROM RESULTADO GROUP BY CPER,CMES,CCODORI,NASIENTO HAVING SUM(NDEBE-NHABER) <0 OR SUM(NDEBES-NHABERS) < 0 OR SUM(NDEBED-NHABERD) < 0 ) AS D ON R.CPER = D.CPER AND R.CMES = D.CMES AND R.CCODORI = D.CCODORI AND R.NASIENTO = D.NASIENTO AND R.NIDLIN = D.NIDLIN-1
UNION ---*************** EL OTRO DESTINO SELECT R.CPER, R.CMES, R.CCODORI, R.NASIENTO AS NASIENTO, D.NIDLIN + 2 AS NIDLIN, 0 AS NTC, vardifph AS CCODCUE, -------- VARDIFPH 0 AS NDEBE, 0 AS NHABER, 'AJUSTE POR DIFERENCIA DE CAMBIO' AS CGLOSA, CASE WHEN R.CMONEDA = 'D' THEN (CASE WHEN D.DIF1S > 0 THEN ABS(D.DIF1S) ELSE 0 END) ELSE 0 END AS NDEBES, CASE WHEN R.CMONEDA = 'D' THEN (CASE WHEN D.DIF1S < 0 THEN ABS(D.DIF1S) ELSE 0 END) ELSE 0 END AS NHABERS, CASE WHEN R.CMONEDA = 'S' THEN (CASE WHEN D.DIF1D > 0 THEN ABS(D.DIF1D) ELSE 0 END) ELSE 0 END AS NDEBED, CASE WHEN R.CMONEDA = 'S' THEN (CASE WHEN D.DIF1D < 0 THEN ABS(D.DIF1D) ELSE 0 END) ELSE 0 END AS NHABERD, 'S' AS cdes, '001' AS cdestino, 0 AS NDIFAUTO, 0 AS NCOMP, '' AS CCODDOC, '' AS CSERIE, '' AS CNUMERO, '' AS CNUMFIN, CAST(NULL AS DATE) AS FFECHADOC, '' AS CCODRUC, '' AS CCODENTI, CAST(NULL AS DATE) AS FFECHAVEN, '' AS CCODFLU, '' AS CCODPAGO, '' AS CCODCOS, '' AS CCODCOS2, '' AS CMREG, CAST(NULL AS DATE) AS FFEC_DC, '' AS CDOC_DC, '' AS CSER_DC, '' AS CNUM_DC, R.CMONEDA, R.FFECHACAN, 0 AS NRESP, ' ' AS CCODPPS, 0 AS NPERDENRE, 0 AS NPORRE, CAST(NULL AS DATE) AS FFECRE, ' ' AS CSERRE, ' ' AS CNUMRE, 0 AS NTCRE, 0 AS NBASERES, 0 AS NBASERED, 0 AS NIMPRES, 0 AS NIMPRED FROM RESULTADO R INNER JOIN (SELECT CPER,CMES,CCODORI,NASIENTO, SUM(NDEBE-NHABER) AS DIF1, SUM(NDEBES-NHABERS) AS DIF1S, SUM(NDEBED-NHABERD) AS DIF1D, MAX(NIDLIN)+1 AS NIDLIN, (CASE WHEN SUM(NDEBED-NHABERD) + SUM(NDEBES-NHABERS)>0 THEN VARDIFG ELSE VARDIFP END) AS CTADIF --- VARDIFG -- VARDIFP FROM RESULTADO GROUP BY CPER,CMES,CCODORI,NASIENTO HAVING SUM(NDEBE-NHABER) <0 OR SUM(NDEBES-NHABERS) < 0 OR SUM(NDEBED-NHABERD) < 0 ) AS D ON R.CPER = D.CPER AND R.CMES = D.CMES AND R.CCODORI = D.CCODORI AND R.NASIENTO = D.NASIENTO AND R.NIDLIN = D.NIDLIN-1 ORDER BY CPER,CMES,CCODORI,NASIENTO,NIDLIN;
