insert into cf_diario (cper,cmes,ccodori,nasiento,ffecasi, cmoneda, ccodusu, tregistro, ccodsu) SELECT DISTINCT ON (CPER,CMES,CCODORI,NASIENTO,FFECHACAN,CMONEDA) CPER,CMES,CCODORI,NASIENTO,FFECHACAN,CMONEDA,'ADMIN',current_timestamp,varlreg FROM RESULTADO ORDER BY CPER,CMES,CCODORI,NASIENTO;
----otro insert INSERT INTO cf_diariol (cper,cmes,ccodori,nasiento,nidlin,ntc,ccodcue,ndebe,nhaber,cglosa,ndebes,nhabers,ndebed,nhaberd,cdes, cdestino,ndifauto,ncomp, ccoddoc,cserie,cnumero,cnumfin,ffechadoc,ccodruc,ccodenti,ffechaven,ccodflu,ccodpago,ccodcos,ccodcos2, cmreg,ffec_dc,cdoc_dc,cser_dc,cnum_dc,NRESP,CCODPPS,NPERDENRE,NPORRE,FFECRE,CSERRE,CNUMRE,NTCRE, NBASERES,NBASERED,NIMPRES,NIMPRED,CLEDMCESTA,CLEDMCPER,CLEDMCMES) select cper,cmes,ccodori,nasiento,nidlin,ntc,ccodcue,ndebe,nhaber,cglosa,ndebes,nhabers,ndebed,nhaberd,cdes,cdestino,ndifauto,ncomp, ccoddoc,cserie,cnumero,cnumfin,ffechadoc,ccodruc,ccodenti,ffechaven,ccodflu,ccodpago,ccodcos,ccodcos2, cmreg,ffec_dc,cdoc_dc,cser_dc,cnum_dc,NRESP,CCODPPS,NPERDENRE,NPORRE,FFECRE,CSERRE,CNUMRE,NTCRE, NBASERES,NBASERED,NIMPRES,NIMPRED,'1',cper,cmes from resultado order by cper, cmes, ccodori, nasiento, nidlin ;
return 1; END; $BODY$ LANGUAGE 'plpgsql' VOLATILE

CREATE OR REPLACE FUNCTION public.com_importar_ventas_principal( ) RETURNS integer
AS $BODY$ /* Autor: Kim martinez select * from com_importar_ventas_principal(); */ DECLARE vnIdreg integer; vnnidlote integer; vnntc numeric(10,2); vncper char(4); vrwStk record; vrwAsi record; vrlote record; vrcorre record; BEGIN vnIdreg := (SELECT coalesce((MAX(cc_Registro.nIdReg)+ 1),1) As nIdReg FROM cc_Registro); -- Cargar Ubigeos perform com_cargar_Ubigeos();
-- Validaciones update com_documento set cserie= lpad(trim(coalesce(cserie,'')),20,'0') , cnumero=lpad(trim(coalesce(cnumero,'')),20,'0') where coalesce(es_con_migracion,0)=0;
-- insertando entidades tributarias Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' error ccodtipent no puede estar vacio es para el tipo de doc.de identidad'), resultado_migracion = 2 where coalesce(ccodtipent,'')='' and es_con_migracion=0;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' Codigo de ubigeo no existe'), resultado_migracion = 2 where ccodtipent = '6' and es_con_migracion=0 and com_documento.ccodubi not in (select ccodubi from cc_ubigeo);
Insert into cg_entitrib (ccodruc,crazsoc, ctipdoc,CNATJUR,cdirec,ccodubi,cdepfin,cprovfin,cdistfin ) select DISTINCT ccodruc,crazsoc,ccodtipent as ctipdoc,case when ccodtipent='1' and Length(ltrim(ccodruc))=8 then '1' when ccodtipent='6' and Length(ltrim(ccodruc))=11 AND SUBSTRING(ltrim(ccodruc),1,2)='10' then '1' when ccodtipent='6' and Length(ltrim(ccodruc))=11 AND SUBSTRING(ltrim(ccodruc),1,2)='20' then '2' when ccodtipent='0' and Length(ltrim(ccodruc))<=15 then '3' when ccodtipent='7' and Length(ltrim(ccodruc))=12 then '1' when ccodtipent='4' and Length(ltrim(ccodruc))=12 then '1' when ccodtipent='4' and Length(ltrim(ccodruc))<11 then '3' END ::CHAR(1) AS CNATJUR,cdirecc,com_documento.ccodubi,cc_ubigeo.cdesubi as cdepfin,b.cdesubi as cprovfin, c.cdesubi as cdistfin FROM com_documento inner join cc_ubigeo on concat(substr(com_documento.ccodubi,1,2),'0000')=cc_ubigeo.ccodubi inner join cc_ubigeo b on concat(substr(com_documento.ccodubi,1,4),'00')=b.ccodubi inner join cc_ubigeo c on com_documento.ccodubi=c.ccodubi WHERE ccodruc not in (select ccodruc from cg_entitrib);
----select * from cg_entitribll insert into cg_entitribll(ccodruc,ccodcontac,ccontitulo,ccontnomb,cdirec) select distinct ccodruc,coalesce(ccodcontac,'') as ccodcontac ,coalesce(ccodcontac,'') as ccontitulo, coalesce(cdescontacto,'') as ccontnomb,coalesce(cdirecc,'') as cdirec from com_documento where es_con_migracion=0 and ccodruc not in (select ccodruc from cg_entitribll);
-------------------------------------------------------------------------------------------------------------- --- NOTAS DE CREDITO y DEBITO Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' No puede esta vacio la ref.doc. NC o ND'), resultado_migracion = 2 where coalesce(crefdoc,'')='' and ccoddoc in('07','08') and es_con_migracion=0;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' No puede esta vacio crefser para NC o ND'), resultado_migracion = 2 where coalesce(crefser,'')='' and ccoddoc in('07','08') and es_con_migracion=0;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' No puede esta vacio crefnum para NC o ND'), resultado_migracion = 2 where coalesce(crefnum,'')='' and ccoddoc in('07','08') and es_con_migracion=0;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' No puede esta vacio cmotinc para NC o ND'), resultado_migracion = 2 where coalesce(cmotinc,'')='' and ccoddoc in('07','08') and es_con_migracion=0;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' No puede esta vacio freffec para NC o ND'), resultado_migracion = 2 where coalesce(to_char(freffec,'yyyymmdd'),'')='' and ccoddoc in('07','08') and es_con_migracion=0;
--------------------------------------------------------------------------------------------------------------- -- VALIDACIONES DE LA CABECERA -- cper, ccoddoc, cserie,cnumero,ccodruc -- PK en VENTAS Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' error no tiene monto total'), resultado_migracion = 2 where coalesce(ntot,0)=0 and es_con_migracion=0;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' error no tiene ruc'), resultado_migracion = 2 where coalesce(ccodruc,'')='' and es_con_migracion=0;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' Codigo de ubigeo no debe estar vacio'), resultado_migracion = 2 where es_con_migracion=0 and coalesce(com_documento.ccodubi,'')='';
-- Validar si el documento ya existe Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' Documento ya fue procesado anteriormente'), resultado_migracion = 2 where es_con_migracion=0 and iddocumento in (select a.iddocumento From com_documento a inner join cc_registro c on a.cper=c.cper and a.ccoddoc=c.ccoddoc and a.cserie=c.cserie and a.cnumero =c.cnumero and a.ccodruc=c.ccodruc);
-- Validar condicion pago exista Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' Codigo pago no existe'), resultado_migracion = 2 where es_con_migracion=0 and com_documento.ccodpag not in (select distinct ccodpag from cc_pago);
-- VALIDACIONES DEL DETALLE -- Conversiond e soles a dolares -- Validar Almacen exista Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' Almacen no existe'), resultado_migracion = 2 where iddocumento in ( select iddocumento from com_detalledocumento where com_detalledocumento.ccodalma not in (select ccodalma from cc_almacen)); -- validar Unidad de medida exista para el producto Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' Unidad de medida no existe en tabla producto '), resultado_migracion = 2 where es_con_migracion=0 and iddocumento in ( select iddocumento from com_detalledocumento where com_detalledocumento.ccodmed not in (select ccodmed from cc_unimed)); -- Validar el producto exista Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' codigo de producto no existe en tabla producto '), resultado_migracion = 2 where es_con_migracion=0 and iddocumento in ( select iddocumento from com_detalledocumento where com_detalledocumento.ccodprod not in (select ccodprod from cc_productos)); -- Validar el lote exista para el producto Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' codigo de lote no existe'), resultado_migracion = 2 where es_con_migracion=0 and iddocumento in ( select iddocumento from com_detalledocumento inner join com_documento using(iddocumento) inner join cc_productos using(ccodprod) where cc_productos.nlote = 1 and CONCAT(com_documento.cper,com_detalledocumento.ccodalma, com_detalledocumento.ccodprod,com_detalledocumento.ccodlote) not in (select CONCAT(cper,ccodalma,ccodprod,ccodlote) from cc_productoslote) );
-- Validar si el producto trabaja con lotes obligar que llene lote al documento siempre encuando el documento este afecto stock Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' codigo de lote no puede estar vacio'), resultado_migracion = 2 where iddocumento in ( select iddocumento from com_detalledocumento where com_detalledocumento.ccodprod in (select A.ccodprod from com_detalledocumento A INNER JOIN CC_PRODUCTOS B ON A.ccodprod=B.ccodprod inner join com_documento C ON A.IDDOCUMENTO=C.IDDOCUMENTO INNER JOIN CC_MOVIMIENTO D on C.ccodmov=d.ccodmov where B.NLOTE=1 and d.nafestock=1) and coalesce(com_detalledocumento.ccodlote,'')='');
-- Validaciones cobranzas -------------------------------------------------------- update com_documento set obserror=CONCAT(ltrim(obserror),'-','EL DOCUMENTO ESTA AL CONTADO Y LA CCUECAN NO EXISTE EN PCGE') , resultado_migracion = 2 WHERE CCUECAN IN( SELECT A.CCUECAN FROM com_documento A left join cf_plan b on a.CCUECAN=b.ccodcue and A.cper=b.cper where A.ccond = 'CON' and coalesce(b.ccodcue ,'ERROR')='ERROR' and A.CCUECAN<>'');
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' El documento esta al contado. No tiene definida la cuenta de cancelación.'), resultado_migracion = 2 where ccond = 'CON' and es_con_migracion=0 and trim(coalesce(ccuecan,'')) = '' ;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' El documento esta al contado. No tiene definido el tipo documento de cancelación.'), resultado_migracion = 2 where ccond = 'CON' and es_con_migracion=0 and trim(coalesce(cdoccan,'')) = '' ;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' El documento esta al contado. No tiene definido la serie de cancelación.'), resultado_migracion = 2 where ccond = 'CON' and es_con_migracion=0 and trim(coalesce(csercan,'')) = '' ;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' El documento esta al contado. No tiene definido el número de operaciónde la cancelación.'), resultado_migracion = 2 where ccond = 'CON' and es_con_migracion=0 and trim(coalesce(cnumcan,'')) = '' ;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' El documento esta al contado. No tiene definido el número de operaciónde la cancelación.'), resultado_migracion = 2 where ccond = 'CON' and es_con_migracion=0 and trim(coalesce(cnumcan,'')) = '' ;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' El documento esta al contado. No tiene definido el sub Diario para la cancelación.'), resultado_migracion = 2 where ccond = 'CON' and es_con_migracion=0 and trim(coalesce(ccodorican,'')) = '' ;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' El documento esta al contado. No tiene definido el Libro Registro para la cancelación.'), resultado_migracion = 2 where ccond = 'CON' and es_con_migracion=0 and trim(coalesce(ccodsucan,'')) = '' ;
Update com_documento set obserror=CONCAT(ltrim(obserror),'-',' El documento esta al contado. No tiene definido el Flujo para la cancelación.'), resultado_migracion = 2 where ccond = 'CON' and es_con_migracion=0 and trim(coalesce(ccodflucan,'')) = '' ;
-- Validaciones cobranzas --------------------------------------------------------
-----*********************************************************************************************************************
-- Creando correlativos para cada documento DROP TABLE IF EXISTS tmpNumnIdreg; create temp table tmpNumnIdreg as select a.iddocumento, vnIdreg + ROW_NUMBER() OVER( order by a.iddocumento) as nidreg, m.nregven as ntipafec,m.nafestock,m.ctiptrans,m.nimpmon, ml.cctares,ml.cdefcos1, ml.cdefcos2,ml.cdefpresu, ent.ccodcos, ent.ccodcos2, ml.nexpcon,m.ctipmov, a.cper,a.ffechaalm,es_con_migracion,obserror from com_documento a inner join cc_movimiento m on a.ccodmov = m.ccodmov and m.ctipmov = 'S' inner join cc_movimientol ml on a.cper = ml.cper and m.ccodmov = ml.ccodmov and m.ctipmov = ml.ctipmov inner join cg_entitrib ent on a.ccodruc = ent.ccodruc where a.es_con_migracion = 0 and trim(coalesce(a.obserror,'')) = '';
-- Instanado cabecera insert into cc_registro(nidreg, cper, cmes, ccodmov, ctipmov, ccoddoc, cserie, cnumero, ccodenti, ccodruc,ccodcontac, ffecha, ffechaven, ffechaalm, ccodpag, cmoneda, ntcigv, ntcbas, ntctot, cguiaser, cguianum, mdsc, ccodvend, ccodclas, ccodocon,cnumordc, crefdoc, freffec,crefser, crefnum, ccat09, cmotinc, nresp, ccodpds, nporre, ffecre, cnumdere, ccodpps, nperdenre, nbase1, nigv1, nbase2, nigv2, nbase3, nigv3, nimpicbper, nina, nexo, nisc, nivabase, nivaimp,nimpant, ntot, nbase1s, nigv1s, nbase2s, nigv2s, nbase3s, nigv3s, ninas, nexos, niscs, nivabases, nivaimps,nimpants, ntots, nbase1d, nigv1d, nbase2d, nigv2d, nbase3d, nigv3d, ninad, nexod, niscd, nivabased, nivaimpd,nimpantd, ntotd, ntipafec,nafestock,ctiptrans,nimpmon,ccodusu) select idr.nidreg, a.cper, a.cmes, a.ccodmov, idr.ctipmov, a.ccoddoc, a.cserie, a.cnumero, a.ccodenti, a.ccodruc, a.ccodcontac, a.ffecha, a.ffechaven, a.ffechaalm, a.ccodpag, a.cmoneda, a.ntcigv, a.ntcigv as ntcbas, a.ntcigv as ntctot, a.cguiaser, a.cguianum, a.mdsc, a.ccodvend, a.ccodclas, a.ccodocon,a.cnumordc, a.crefdoc, a.freffec, a.crefser, a.crefnum, a.ccat09, a.cmotinc, a.nresp, a.ccodpds, case when a.nresp = 1 then a.nporre else a.nporre2 end as nporre, a.ffecre, a.cnumdere, a.ccodpps, a.nperdenre, a.nbase1, a.nigv1, a.nbase2, a.nigv2, a.nbase3, a.nigv3, a.nimpicbper, a.nina, a.nexo, a.nisc, a.nivabase, a.nivaimp,a.nimpant, a.ntot, Case when a.cmoneda='S' then a.nbase1 else round(a.nbase1*a.ntcigv,2) END as nbase1s, Case when a.cmoneda='S' then a.nigv1 else round(a.nigv1*a.ntcigv,2) END as nigv1s, Case when a.cmoneda='S' then a.nbase2 else round(a.nbase2*a.ntcigv,2) END as nbase2s, Case when a.cmoneda='S' then a.nigv2 else round(a.nigv2*a.ntcigv,2) END as nigv2s, Case when a.cmoneda='S' then a.nbase3 else round(a.nbase3*a.ntcigv,2) END as nbase3s, Case when a.cmoneda='S' then a.nigv3 else round(a.nigv3*a.ntcigv,2) END as nigv3s, Case when a.cmoneda='S' then a.nina else round(a.nina*a.ntcigv,2) END as ninas, Case when a.cmoneda='S' then a.nexo else round(a.nexo*a.ntcigv,2) END as nexos, Case when a.cmoneda='S' then a.nisc else round(a.nisc*a.ntcigv,2) END as niscs, Case when a.cmoneda='S' then a.nivabase else round(a.nivabase*a.ntcigv,2) END as nivabases, Case when a.cmoneda='S' then a.nivaimp else round(a.nivaimp*a.ntcigv,2) END as nivaimps, Case when a.cmoneda='S' then a.nimpant else round(a.nimpant*a.ntcigv,2) END as nimpants, Case when a.cmoneda='S' then a.ntot else round(a.ntot*a.ntcigv,2) END as ntots, Case when a.cmoneda='D' then a.nbase1 else round(a.nbase1/a.ntcigv,2) END as nbase1d, Case when a.cmoneda='D' then a.nigv1 else round(a.nigv1/a.ntcigv,2) END as nigv1d, Case when a.cmoneda='D' then a.nbase2 else round(a.nbase2/a.ntcigv,2) END as nbase2d, Case when a.cmoneda='D' then a.nigv2 else round(a.nigv2/a.ntcigv,2) END as nigv2d, Case when a.cmoneda='D' then a.nbase3 else round(a.nbase3/a.ntcigv,2) END as nbase3d, Case when a.cmoneda='D' then a.nigv3 else round(a.nigv3/a.ntcigv,2) END as nigv3d, Case when a.cmoneda='D' then a.nina else round(a.nina/a.ntcigv,2) END as ninad, Case when a.cmoneda='D' then a.nexo else round(a.nexo/a.ntcigv,2) END as nexod, Case when a.cmoneda='D' then a.nisc else round(a.nisc/a.ntcigv,2) END as niscd, Case when a.cmoneda='D' then a.nivabase else round(a.nivabase/a.ntcigv,2) END as nivabased, Case when a.cmoneda='D' then a.nivaimp else round(a.nivaimp/a.ntcigv,2) END as nivaimpd, Case when a.cmoneda='D' then a.nimpant else round(a.nimpant/a.ntcigv,2) END as nimpantd, Case when a.cmoneda='D' then a.ntot else round(a.ntot/a.ntcigv,2) END as ntotd, idr.ntipafec,idr.nafestock,mm.ctipmov,idr.nimpmon,'ADMIN' from com_documento a inner join tmpNumnIdreg idr on a.iddocumento = idr.iddocumento inner join cc_movimiento mm on a.ccodmov=mm.ccodmov AND a.ccoddoc=mm.ccoddoc and a.cserie=mm.cserie and mm.ctipmov='S' where a.es_con_migracion = 0 and trim(coalesce(a.obserror,'')) = '' ;
-- Isertar detalle insert into cc_registrol(nidreg, nidlin, cper, cmes, ccodalma, ccodalmas, ccodalmades, ccodalmasdes, ccodprod, cdesprod, ccodlote, nuniori, nvvori, npvori, ntotori, npigv, ncolreg, nvalor, nigvtot, ccodmed, nconvnum, nconvden, clibprod, nunikar, npukar, ntotkar, nvvoris, npvoris, ntotoris, nvvorid, npvorid, ntotorid, nvalors, nigvtots, nvalord, nigvtotd, npukars, ntotkars, npukard, ntotkard, ccodcos, ccodcos2, ccodpresu, ncostos, ncostod ,cctaprod,npordscu, ndsctos, ccodisc, nporisc, nisc, mdscl, nvvtg, nvvtgs, nvvtgd, nimptg, nimptgs, nimptgd)
select idr.nidreg,ROW_NUMBER() OVER(partition by a.iddocumento order by a.iddocumento) as nidlin, ac.cper, ac.cmes,a.ccodalma,d.ccodalmas,'' as ccodalmades,'' as ccodalmasdes , a.ccodprod, b.cdesprod, a.ccodlote,a.nuniori, a.nvvori, a.npvori, a.ntotori, --a.npigv, case idr.ntipafec when 1 then a.npigv when 2 then 0.00 when 3 then 0.00 when 4 then 0.00 when 5 then pr.nivapor end::numeric(5,2) as npigv, 1 as ncolreg, a.nvalor, a.nigvtot,a.ccodmed, 1 as nconvnum, 1 as nconvden, case idr.ntipafec when 1 then c.cvenprod when 2 then '4' when 3 then '5' when 4 then '2' when 5 then c.cvenprod end::char(1) as clibprod, a.nuniori as nunikar , a.nvvori/1 as npukar ,a.nvalor as ntotkar, Case when ac.cmoneda='S' THEN a.nvvori ELSE round(a.nvvori*ac.ntcigv,2) END as nvvoris, Case when ac.cmoneda='S' THEN a.npvori ELSE round(a.npvori*ac.ntcigv,2) END as npvoris, Case when ac.cmoneda='S' THEN a.ntotori ELSE round(a.ntotori*ac.ntcigv,2) END as ntotoris, Case when ac.cmoneda='D' THEN a.nvvori ELSE round(a.nvvori/aC.ntcigv,2) END as nvvorid, Case when ac.cmoneda='D' THEN a.npvori ELSE round(a.npvori/aC.ntcigv,2) END as npvorid, Case when ac.cmoneda='D' THEN a.ntotori ELSE round(a.ntotori/aC.ntcigv,2) END as ntotorid, Case when ac.cmoneda='S' THEN a.nvalor ELSE round(a.nvalor*ac.ntcigv,2) END as nvalors, Case when ac.cmoneda='S' THEN a.nigvtot ELSE round(a.nigvtot*ac.ntcigv,2) END as nigvtots, Case when ac.cmoneda='D' THEN a.nvalor ELSE round(a.nvalor/ac.ntcigv,2) END as nvalord, Case when ac.cmoneda='D' THEN a.nigvtot ELSE round(a.nigvtot/ac.ntcigv,2) END as nigvtotd, Case when ac.cmoneda='S' THEN a.nuniori ELSE round(a.nuniori*ac.ntcigv,2) END as npukars, Case when ac.cmoneda='S' THEN a.nvalor ELSE round(a.nvalor*ac.ntcigv,2) END as ntotkars, Case when ac.cmoneda='D' THEN (a.nvvori/1) ELSE round((a.nvvori/1)/aC.ntcigv,2) END as npukard, Case when ac.cmoneda='D' THEN a.nvalor ELSE round((a.nvalor/ac.ntcigv),2) END as ntotkard, case when trim(coalesce(a.ccodcos,'')) <> '' then trim(a.ccodcos) else case when trim(coalesce(idr.ccodcos,'')) <> '' then trim(idr.ccodcos) else case when trim(coalesce(c.ccodcos)) <> '' then trim(c.ccodcos) else trim(idr.cdefcos1) end end end::character(9) as ccodcos, case when trim(coalesce(a.ccodcos2,'')) <> '' then trim(a.ccodcos2) else case when trim(coalesce(idr.ccodcos2,'')) <> '' then trim(idr.ccodcos2) else case when trim(coalesce(c.ccodcos2)) <> '' then trim(c.ccodcos2) else trim(idr.cdefcos2) end end end::character(9) as ccodcos2, case when trim(coalesce(a.ccodpresu,'')) <> '' then trim(a.ccodpresu) else case when trim(c.ccodpresu) <> '' then trim(c.ccodpresu) else trim(idr.cdefcos1) end end::character(10) as ccodpresu, 0 as ncostos, 0 as ncostod, case when trim(coalesce(a.cctaprod,'')) <> '' then trim(a.cctaprod) else case when trim(coalesce(c.ccomcue,'')) <> '' then trim(c.ccomcue) else trim(idr.cctares) end end::character(20) as cctaprod, a.npordscu, a.ndsctos, a.ccodisc, a.nporisc, a.nisc, a.mdscl, 0.00 as nvvtg, 0.00 as nvvtgs, 0.00 as nvvtgd, 0.00 as nimptg, 0.00 as nimptgs, 0.00 as nimptgd
from com_detalledocumento a inner join tmpNumnIdreg idr on a.iddocumento = idr.iddocumento inner join com_documento ac on a.iddocumento = ac.iddocumento inner join cc_productos b on a.ccodprod = b.ccodprod inner join cc_productosc c on b.ccodprod = c.ccodprod and c.cper = ac.cper inner join cc_almacen d on a.ccodalma = d.ccodalma inner join cg_emppro pr on ac.cper = pr.cper where ac.es_con_migracion = 0 and trim(coalesce(ac.obserror,'')) = '';
-- Actualizar stock en y en lotes for vrwStk in select r.nidreg, r.cper,lpad(trim(to_char(EXTRACT(month FROM r.ffechaalm),'99')),2,'0')::varchar(2) as mes, a.ccodprod,r.ctipmov from com_detalledocumento a inner join tmpNumnIdreg r on a.iddocumento = r.iddocumento where r.nafestock = 1 and r.nimpmon = 0 and r.es_con_migracion = 0 and trim(coalesce(r.obserror,'')) = '' loop
perform com_importar_compras_ventas_principal_Actualiza_stock(vrwStk.cper::char(4), vrwStk.mes::Char(2),vrwStk.ccodprod::char(20),vrwStk.ctipmov::char(1));
end loop;
-- Generar Asientos contables de todos los registros cargados for vrwAsi in select idr.nidreg,nexpcon, a.cper from com_documento a inner join tmpNumnIdreg idr on a.iddocumento = idr.iddocumento where idr.nexpcon = 1 and a.es_con_migracion = 0 and trim(coalesce(a.obserror,'')) = '' loop --raise exception 'error pruebas '; perform com_importar_ventas_generaasiento(vrwAsi.cper::char(4), vrwAsi.nidreg::Integer);
end loop;
-- Actualizar correlativo en documento for vrcorre in select max(cnumero::integer) as nnumdoc,ccoddoc,cserie from com_documento group by ccoddoc,cserie loop
update cc_numdoc set nnumdoc=vrcorre.nnumdoc+1 where ccoddoc=vrcorre.ccoddoc and cserdoc=vrcorre.cserie and ctipmov='S';
end loop;
-- Confoirmacion update com_documento set resultado_migracion=1,obserror='registrado' where ccodmodulo='VENTA' AND es_con_migracion = 0 and trim(coalesce(obserror,'')) = '';
-- Validamos si en la carga existe registros Anulados perform com_importar_ventas_principal_Anular(); update com_documento set obserror='Anulación Existosa' where ccodmodulo='VENTA' and resultado_migracion=4; update com_documento set obserror='Documento no existe Anular/Eliminar' where ccodmodulo='VENTA' and resultado_migracion=5;
-- Manda cobranzas -------------------------------------------------------------------------------------------------------- perform com_importar_ventas_generaasiento_cobranza_principal(); -- Manda cobranzas --------------------------------------------------------------------------------------------------------
RETURN 1;
END; $BODY$ LANGUAGE 'plpgsql' VOLATILE

CREATE OR REPLACE FUNCTION com_importar_ventas_generaasiento_cobranza_principal()
    RETURNS void
AS $BODY$
	/*
		Autor: Kim martinez
		select * from com_importar_ventas_generaasiento_cobranza_principal() 
	*/ 
DECLARE  
	RW RECORD;
	rwperproceso record; 
	rwemp record; 
	vardifp character(10);
	vardifpd character(10);
	vardifph character(10); 
	vardifg character(10);
	varmax integer;
	VCMAXASIENTO text = ''; 
	rw2 record;  
	rwanuladoc record;  
	nreturn integer=0;
	rwctualizasubdiario record;
	vcregper character(20); 
	vcregperc character(20); 
	varperc character(20); 
	vccodenti character(11);
	vflag_dp numeric(1,0); 

BEGIN
	-- Validaciones fin_cobranzapago 
	vflag_dp := (select flag_dp from registro_dp where codigo_dp = 'DP008'); 
	vflag_dp := coalesce(vflag_dp,0); 


	for rwperproceso in select distinct cper as cperproceso, ccodmodulo from com_documento order by ccodmodulo loop 	
		-- propiedades de empresa por periodos 
		for rwemp in select cper, cctaper, cctagan, cregper,cregperc,ccodenti
				     from cg_emppro  
				     where cper =rwperproceso.cperproceso loop		

			    vcregper = rwemp.cregper; 
			    vcregperc = rwemp.cregperc;		    
			    vardifp = rwemp.cctaper ;		    
			    vardifpd = (select cdesdeb from cf_plan where cper = rwemp.cper and ccodcue = rwemp.cctaper);  
			    vardifph = (select cdeshab from cf_plan where cper = rwemp.cper and ccodcue = rwemp.cctaper);		    
			    vardifg = rwemp.cctagan ;	
			    vccodenti =	 rwemp.ccodenti;   							
			    if rwperproceso.ccodmodulo = 'VENTA' then -- Cobranzas 
					varperc = vcregper; 
			    else 
					varperc = vcregperc;  -- Pagos 
			    end if; 
		end loop; 	

		/*
			update  fin_cobranzapago set obserror=CONCAT(ltrim(obserror),'-',' CENTRO DE COSTO NO EXISTE ') ,  resultado_migracion = 2 
			where  fin_cobranzapago.cper=rwperproceso.cperproceso and   fin_cobranzapago.es_con_migracion=0 and  fin_cobranzapago.ccodcos<>' ' AND idcobranzapago not in(
			Select idcobranzapago From fin_cobranzapago inner join CG_COSTOS on
			fin_cobranzapago.ccodcos=CG_COSTOS.ccodcos  WHERE  fin_cobranzapago.cper=rwperproceso.cperproceso); 	

			update  fin_cobranzapago set obserror=CONCAT(ltrim(obserror),'-',' CENTROS DE COSTO 2 NO EXISTE ') ,  resultado_migracion = 2 
			where  fin_cobranzapago.cper=rwperproceso.cperproceso and   fin_cobranzapago.es_con_migracion=0 and  fin_cobranzapago.ccodcos2<>' ' and idcobranzapago not in(
			Select idcobranzapago From fin_cobranzapago inner join CG_COSTOS2 on
			fin_cobranzapago.ccodcos2=CG_COSTOS2.ccodcos2  WHERE  fin_cobranzapago.cper=rwperproceso.cperproceso); 
		*/

		-- Cursor no existe provision 
		DROP TABLE IF EXISTS documentonoprovisionados; 
		create temp table documentonoprovisionados as		
		select pgl.cctaven as ccodcue, rc.ccodruc, rc.ccoddoc, rc.cserie, rc.cnumero,dl.ccodcue as d_ccodcue,  dl.ccodruc as d_ccodruc, 
			dl.ccoddoc as d_ccoddoc, dl.cserie as d_cserie, dl.cnumero as d_cnumero
	        from com_documento rc 
			inner join cc_pago pg on rc.ccodpag = pg.ccodpag
			inner join cc_pagol pgl on rc.ccodpag = pgl.ccodpag and pgl.cper = rwperproceso.cperproceso
	        left join cf_diariol dl on pgl.cctaven = dl.ccodcue and 
	       							  rc.ccodruc = dl.ccodruc and 
	       							  rc.ccoddoc = dl.ccoddoc and 
	       							  rc.cserie = dl.cserie and 
	       							  rc.cnumero = dl.cnumero and 
	       							  dl.ncomp = 1 and rc.cper =rwperproceso.cperproceso
		where rc.ccond = 'CON' and coalesce(resultado_migracion,0) = 1  and dl.ccodcue is null; 

		update com_documento set obserrorcan=CONCAT(ltrim(obserrorcan),'-',' Documento no Provisionado...'),  resultadocan_migracion = 2  
		where cper=rwperproceso.cperproceso  and ccodmodulo = rwperproceso.ccodmodulo and ccond = 'CON' and concat(ccoddoc,cserie,cnumero,ccodruc)  in ( select concat(ccoddoc,cserie,cnumero,ccodruc) from documentonoprovisionados );
		-- Fin - Cursor no existe provision 


		for rw in select distinct cper, cmes, ccodorican, ccodsucan, ccodflucan
			  		FROM com_documento  
			  		where cper =  rwperproceso.cperproceso and ccodmodulo = rwperproceso.ccodmodulo and ccond = 'CON' and  trim(coalesce(obserrorcan,'')) = ''  loop -- esten OK 

			  VCMAXASIENTO = 'SELECT NORIMES' || cast(rw.cmes as integer)::char(2) || ' AS NORIGEN FROM CF_ORIGENL WHERE CPER = ''' || rw.cper || ''' AND CCODORI = ''' || rw.ccodorican ||'''' ;
			  for rw2 in EXECUTE VCMAXASIENTO	loop
					varmax  = coalesce(RW2.NORIGEN,0)+1; ---+ 1; -- RW2.NORIGEN + 1;
			  end loop;

			  -- Truncar tabla Cada vez carga data por cada subdiario 		
			 truncate table com_cobranzapago_integra; 

			 INSERT INTO com_cobranzapago_integra(idcobranzapago, ffechacan, cdoccan, csercan, cnumcan, ccuecan, 
							    cmoncan, nimporcan, ntipcam, ccodpago, ccoddoc, cserie, cnumero, 
							    ffechadoc, ffechaven, ccodenti, ccodruc, crazsoc, nimportes, 
							    nimported, ccodcue, cglosa, ccodcos, ccodcos2, nporre, nimpperc, 
							    nperdenre, cserre, cnumre, ffecre)
			 SELECT  a.iddocumento, a.ffecha as ffechacan, coalesce(a.cdoccan,'')::character(2) as cdoccan, coalesce(a.csercan,'')::character(20) as csercan, 
				 	coalesce(a.cnumcan,'')::character(20) as cnumcan, coalesce(a.ccuecan,'')::character(20) as ccuecan, 
				    a.cmoneda as cmoncan, a.ntot as nimporcan, a.ntcigv as ntipcam, a.ccodpag as ccodpago, a.ccoddoc, a.cserie, a.cnumero, 
				    a.ffecha as ffechadoc, a.ffechaven, a.ccodenti, a.ccodruc, a.crazsoc, 
				 	case when a.cmoneda = 'S' then a.ntot else 0.00 end as nimportes, 
				    case when a.cmoneda = 'D' then a.ntot else 0.00 end nimported, 
				 	pgl.cctaven as  ccodcue, a.mdsc as  cglosa, '' as ccodcos, '' as ccodcos2, a.nporre, .00 as nimpperc, 
				    a.nperdenre, '' as cserre, '' as cnumre, null  as ffecre 
			 FROM com_documento	a 	
			 inner join cc_movimiento m on a.ccodmov = m.ccodmov and m.ctipmov = 'S'
			 inner join cc_movimientol  ml on ml.cper = rwperproceso.cperproceso and m.ccodmov = ml.ccodmov and m.ctipmov = ml.ctipmov
			 inner join cc_pago pg on a.ccodpag = pg.ccodpag
			 inner join cc_pagol pgl on a.ccodpag = pgl.ccodpag and pgl.cper = rwperproceso.cperproceso
			 where a.cper=rw.cper and 
				a.ccodmodulo = 'VENTA' and 
				a.ccond = 'CON' and a.ccodorican = rw.ccodorican and a.ccodorican=rw.ccodorican and 
				a.ccodsucan=rw.ccodsucan and a.ccodflucan = rw.ccodflucan and 
				trim(coalesce(a.obserrorcan,'')) = '' and coalesce(resultado_migracion,0) = 1 
				and a.es_con_migracion in(0) 
				order by a.ccoddoc,a.cserie,a.cnumero,a.ccodruc asc; 				

			 -- Integra las cobranzas 
			 nreturn = (SELECT * FROM com_importar_ventas_generaasiento_cobranza(rw.cper,
																				  rw.cmes,
																				  rw.ccodorican,
																				  rw.ccodflucan,
																				  rw.ccodsucan,											 
																				  vardifp,
																				  vardifpd,
																				  vardifph,
																				  vardifg,											  				
																				  varmax,											  
																				  rwperproceso.ccodmodulo,
																				  varperc));

		  end loop;  

			update com_documento set resultadocan_migracion = 1 where ccond = 'CON' and es_con_migracion = 0 and iddocumento in (select idcobranzapago from com_cobranzapago_integra); 

			-- Actualizar los anulados a 4 
			update com_documento set resultadocan_migracion = 4 where ccond = 'CON' and es_con_migracion = 3 and trim(coalesce(obserrorcan,'')) = '' ;  
			-- anular Los registros 			

			DROP TABLE IF EXISTS documentosAnula;
			create temp table documentosAnula as 
			select a.cper, a.cmes, a.ccodori, a.nasiento, a.ncomp,a.ccoddoc, a.cserie, a.cnumero, a.ccodruc
			from cf_diariol a
			inner join com_documento b  on a.ccoddoc = b.cdoccan  and a.cserie = b.csercan and a.cnumero = b.cnumcan and a.ccodcue = b.ccuecan 
							and trim(coalesce(obserrorcan,'')) = ''
							and es_con_migracion = 3 
			where a.cper = rwperproceso.cperproceso and a.ncomp = 0  ;

			for rwanuladoc in select cper, cmes, ccodori, nasiento, ncomp,ccoddoc, cserie, cnumero, ccodruc from documentosAnula  loop 
				DELETE FROM cf_diariol
				where cper = rwanuladoc.cper and cmes = rwanuladoc.cmes and  ccodori = rwanuladoc.ccodori and nasiento = rwanuladoc.nasiento  ; 

				DELETE FROM cf_diario
				where cper = rwanuladoc.cper and cmes = rwanuladoc.cmes and  ccodori = rwanuladoc.ccodori and nasiento = rwanuladoc.nasiento  ; 
			end loop; 


			--raise exception 'ccod sub %', rw.cper; 
			-- Actualiza subdiartio y Flujos 
			for rwctualizasubdiario  in select distinct cper,cmes from com_documento  loop

				nreturn = (select * from func_regenerar_correlativo_subdiario(rwctualizasubdiario.cper, rwctualizasubdiario.cmes) as infograba1); 
				nreturn = (select * from func_regenerar_saldos_plan_flujo(rwctualizasubdiario.cper, rwctualizasubdiario.cmes) as infograba2); 			 

			end loop;

			-- Cancelacion de documentos 
			nreturn = (select * from com_importar_cobranzapago_integrador_cancelacion_impcobpag(rwperproceso.cperproceso) as infograba2);

	end loop; 

END; 
$BODY$ 
LANGUAGE 'plpgsql' VOLATILE

