-- Creando correlativos para cada documento DROP TABLE IF EXISTS tmpNumnIdreg; create temp table tmpNumnIdreg as select a.iddocumento, vnIdreg + ROW_NUMBER() OVER( order by a.iddocumento) as nidreg, m.nregven as ntipafec,m.nafestock,m.ctiptrans,m.nimpmon, ml.cctares,ml.cdefcos1, ml.cdefcos2,ml.cdefpresu, ent.ccodcos, ent.ccodcos2, ml.nexpcon,m.ctipmov, a.cper,a.ffechaalm,es_con_migracion,obserror from com_documento a inner join cc_movimiento m on a.ccodmov = m.ccodmov and m.ctipmov = 'S' inner join cc_movimientol ml on a.cper = ml.cper and m.ccodmov = ml.ccodmov and m.ctipmov = ml.ctipmov inner join cg_entitrib ent on a.ccodruc = ent.ccodruc where a.es_con_migracion = 0 and trim(coalesce(a.obserror,'')) = '';
-- Instanado cabecera insert into cc_registro(nidreg, cper, cmes, ccodmov, ctipmov, ccoddoc, cserie, cnumero, ccodenti, ccodruc,ccodcontac, ffecha, ffechaven, ffechaalm, ccodpag, cmoneda, ntcigv, ntcbas, ntctot, cguiaser, cguianum, mdsc, ccodvend, ccodclas, ccodocon,cnumordc, crefdoc, freffec,crefser, crefnum, ccat09, cmotinc, nresp, ccodpds, nporre, ffecre, cnumdere, ccodpps, nperdenre, nbase1, nigv1, nbase2, nigv2, nbase3, nigv3, nimpicbper, nina, nexo, nisc, nivabase, nivaimp,nimpant, ntot, nbase1s, nigv1s, nbase2s, nigv2s, nbase3s, nigv3s, ninas, nexos, niscs, nivabases, nivaimps,nimpants, ntots, nbase1d, nigv1d, nbase2d, nigv2d, nbase3d, nigv3d, ninad, nexod, niscd, nivabased, nivaimpd,nimpantd, ntotd, ntipafec,nafestock,ctiptrans,nimpmon,ccodusu,cglosa) select idr.nidreg, a.cper, a.cmes, a.ccodmov, idr.ctipmov, a.ccoddoc, a.cserie, a.cnumero, a.ccodenti, a.ccodruc, a.ccodcontac, a.ffecha, a.ffechaven, a.ffechaalm, a.ccodpag, a.cmoneda, a.ntcigv, a.ntcigv as ntcbas, a.ntcigv as ntctot, a.cguiaser, a.cguianum, a.mdsc, a.ccodvend, a.ccodclas, a.ccodocon,a.cnumordc, a.crefdoc, a.freffec, a.crefser, a.crefnum, a.ccat09, a.cmotinc, a.nresp, a.ccodpds, case when a.nresp = 1 then a.nporre else a.nporre2 end as nporre, a.ffecre, a.cnumdere, a.ccodpps, a.nperdenre, a.nbase1, a.nigv1, a.nbase2, a.nigv2, a.nbase3, a.nigv3, a.nimpicbper, a.nina, a.nexo, a.nisc, a.nivabase, a.nivaimp,a.nimpant, a.ntot, Case when a.cmoneda='S' then a.nbase1 else round(a.nbase1*a.ntcigv,2) END as nbase1s, Case when a.cmoneda='S' then a.nigv1 else round(a.nigv1*a.ntcigv,2) END as nigv1s, Case when a.cmoneda='S' then a.nbase2 else round(a.nbase2*a.ntcigv,2) END as nbase2s, Case when a.cmoneda='S' then a.nigv2 else round(a.nigv2*a.ntcigv,2) END as nigv2s, Case when a.cmoneda='S' then a.nbase3 else round(a.nbase3*a.ntcigv,2) END as nbase3s, Case when a.cmoneda='S' then a.nigv3 else round(a.nigv3*a.ntcigv,2) END as nigv3s, Case when a.cmoneda='S' then a.nina else round(a.nina*a.ntcigv,2) END as ninas, Case when a.cmoneda='S' then a.nexo else round(a.nexo*a.ntcigv,2) END as nexos, Case when a.cmoneda='S' then a.nisc else round(a.nisc*a.ntcigv,2) END as niscs, Case when a.cmoneda='S' then a.nivabase else round(a.nivabase*a.ntcigv,2) END as nivabases, Case when a.cmoneda='S' then a.nivaimp else round(a.nivaimp*a.ntcigv,2) END as nivaimps, Case when a.cmoneda='S' then a.nimpant else round(a.nimpant*a.ntcigv,2) END as nimpants, Case when a.cmoneda='S' then a.ntot else round(a.ntot*a.ntcigv,2) END as ntots, Case when a.cmoneda='D' then a.nbase1 else round(a.nbase1/a.ntcigv,2) END as nbase1d, Case when a.cmoneda='D' then a.nigv1 else round(a.nigv1/a.ntcigv,2) END as nigv1d, Case when a.cmoneda='D' then a.nbase2 else round(a.nbase2/a.ntcigv,2) END as nbase2d, Case when a.cmoneda='D' then a.nigv2 else round(a.nigv2/a.ntcigv,2) END as nigv2d, Case when a.cmoneda='D' then a.nbase3 else round(a.nbase3/a.ntcigv,2) END as nbase3d, Case when a.cmoneda='D' then a.nigv3 else round(a.nigv3/a.ntcigv,2) END as nigv3d, Case when a.cmoneda='D' then a.nina else round(a.nina/a.ntcigv,2) END as ninad, Case when a.cmoneda='D' then a.nexo else round(a.nexo/a.ntcigv,2) END as nexod, Case when a.cmoneda='D' then a.nisc else round(a.nisc/a.ntcigv,2) END as niscd, Case when a.cmoneda='D' then a.nivabase else round(a.nivabase/a.ntcigv,2) END as nivabased, Case when a.cmoneda='D' then a.nivaimp else round(a.nivaimp/a.ntcigv,2) END as nivaimpd, Case when a.cmoneda='D' then a.nimpant else round(a.nimpant/a.ntcigv,2) END as nimpantd, Case when a.cmoneda='D' then a.ntot else round(a.ntot/a.ntcigv,2) END as ntotd, idr.ntipafec,idr.nafestock,mm.ctipmov,idr.nimpmon,'ADMIN', concat(CASE WHEN a.ccoddoc='07' then 'NOTA DE CREDITO ' ELSE a.ccodmodulo END,' - ',right(trim(a.cserie),4),'-',right(trim(a.cnumero),8)) :: character(80) as cglosa from com_documento a inner join tmpNumnIdreg idr on a.iddocumento = idr.iddocumento inner join cc_movimiento mm on a.ccodmov=mm.ccodmov AND a.ccoddoc=mm.ccoddoc and a.cserie=mm.cserie and mm.ctipmov='S' where a.es_con_migracion = 0 and trim(coalesce(a.obserror,'')) = '' ;
-- Isertar detalle insert into cc_registrol(nidreg, nidlin, cper, cmes, ccodalma, ccodalmas, ccodalmades, ccodalmasdes, ccodprod, cdesprod, ccodlote, nuniori, nvvori, npvori, ntotori, npigv, ncolreg, nvalor, nigvtot, ccodmed, nconvnum, nconvden, clibprod, nunikar, npukar, ntotkar, nvvoris, npvoris, ntotoris, nvvorid, npvorid, ntotorid, nvalors, nigvtots, nvalord, nigvtotd, npukars, ntotkars, npukard, ntotkard, ccodcos, ccodcos2, ccodpresu, ncostos, ncostod ,cctaprod,npordscu, ndsctos, ccodisc, nporisc, nisc, mdscl, nvvtg, nvvtgs, nvvtgd, nimptg, nimptgs, nimptgd)
select idr.nidreg,ROW_NUMBER() OVER(partition by a.iddocumento order by a.iddocumento) as nidlin, ac.cper, ac.cmes,a.ccodalma,d.ccodalmas,'' as ccodalmades,'' as ccodalmasdes , a.ccodprod, b.cdesprod, a.ccodlote,a.nuniori, a.nvvori, a.npvori, a.ntotori, --a.npigv, case idr.ntipafec when 1 then a.npigv when 2 then 0.00 when 3 then 0.00 when 4 then 0.00 when 5 then pr.nivapor end::numeric(5,2) as npigv, 1 as ncolreg, a.nvalor, a.nigvtot,a.ccodmed, 1 as nconvnum, 1 as nconvden, case idr.ntipafec when 1 then c.cvenprod when 2 then '4' when 3 then '5' when 4 then '2' when 5 then c.cvenprod end::char(1) as clibprod, a.nuniori as nunikar , a.nvvori/1 as npukar ,a.nvalor as ntotkar, Case when ac.cmoneda='S' THEN a.nvvori ELSE round(a.nvvori*ac.ntcigv,2) END as nvvoris, Case when ac.cmoneda='S' THEN a.npvori ELSE round(a.npvori*ac.ntcigv,2) END as npvoris, Case when ac.cmoneda='S' THEN a.ntotori ELSE round(a.ntotori*ac.ntcigv,2) END as ntotoris, Case when ac.cmoneda='D' THEN a.nvvori ELSE round(a.nvvori/aC.ntcigv,2) END as nvvorid, Case when ac.cmoneda='D' THEN a.npvori ELSE round(a.npvori/aC.ntcigv,2) END as npvorid, Case when ac.cmoneda='D' THEN a.ntotori ELSE round(a.ntotori/aC.ntcigv,2) END as ntotorid, Case when ac.cmoneda='S' THEN a.nvalor ELSE round(a.nvalor*ac.ntcigv,2) END as nvalors, Case when ac.cmoneda='S' THEN a.nigvtot ELSE round(a.nigvtot*ac.ntcigv,2) END as nigvtots, Case when ac.cmoneda='D' THEN a.nvalor ELSE round(a.nvalor/ac.ntcigv,2) END as nvalord, Case when ac.cmoneda='D' THEN a.nigvtot ELSE round(a.nigvtot/ac.ntcigv,2) END as nigvtotd, Case when ac.cmoneda='S' THEN a.nuniori ELSE round(a.nuniori*ac.ntcigv,2) END as npukars, Case when ac.cmoneda='S' THEN a.nvalor ELSE round(a.nvalor*ac.ntcigv,2) END as ntotkars, Case when ac.cmoneda='D' THEN (a.nvvori/1) ELSE round((a.nvvori/1)/aC.ntcigv,2) END as npukard, Case when ac.cmoneda='D' THEN a.nvalor ELSE round((a.nvalor/ac.ntcigv),2) END as ntotkard, case when trim(coalesce(a.ccodcos,'')) <> '' then trim(a.ccodcos) else case when trim(coalesce(idr.ccodcos,'')) <> '' then trim(idr.ccodcos) else case when trim(coalesce(c.ccodcos)) <> '' then trim(c.ccodcos) else trim(idr.cdefcos1) end end end::character(9) as ccodcos, case when trim(coalesce(a.ccodcos2,'')) <> '' then trim(a.ccodcos2) else case when trim(coalesce(idr.ccodcos2,'')) <> '' then trim(idr.ccodcos2) else case when trim(coalesce(c.ccodcos2)) <> '' then trim(c.ccodcos2) else trim(idr.cdefcos2) end end end::character(9) as ccodcos2, case when trim(coalesce(a.ccodpresu,'')) <> '' then trim(a.ccodpresu) else case when trim(c.ccodpresu) <> '' then trim(c.ccodpresu) else trim(idr.cdefcos1) end end::character(10) as ccodpresu, 0 as ncostos, 0 as ncostod, case when trim(coalesce(a.cctaprod,'')) <> '' then trim(a.cctaprod) else case when trim(coalesce(c.ccomcue,'')) <> '' then trim(c.ccomcue) else trim(idr.cctares) end end::character(20) as cctaprod, a.npordscu, a.ndsctos, a.ccodisc, a.nporisc, a.nisc, a.mdscl, 0.00 as nvvtg, 0.00 as nvvtgs, 0.00 as nvvtgd, 0.00 as nimptg, 0.00 as nimptgs, 0.00 as nimptgd
from com_detalledocumento a inner join tmpNumnIdreg idr on a.iddocumento = idr.iddocumento inner join com_documento ac on a.iddocumento = ac.iddocumento inner join cc_productos b on a.ccodprod = b.ccodprod inner join cc_productosc c on b.ccodprod = c.ccodprod and c.cper = ac.cper inner join cc_almacen d on a.ccodalma = d.ccodalma inner join cg_emppro pr on ac.cper = pr.cper where ac.es_con_migracion = 0 and trim(coalesce(ac.obserror,'')) = '';
-- Actualizar stock en y en lotes for vrwStk in select r.nidreg, r.cper,lpad(trim(to_char(EXTRACT(month FROM r.ffechaalm),'99')),2,'0')::varchar(2) as mes, a.ccodprod,r.ctipmov from com_detalledocumento a inner join tmpNumnIdreg r on a.iddocumento = r.iddocumento where r.nafestock = 1 and r.nimpmon = 0 and r.es_con_migracion = 0 and trim(coalesce(r.obserror,'')) = '' loop
perform com_importar_compras_ventas_principal_Actualiza_stock(vrwStk.cper::char(4), vrwStk.mes::Char(2),vrwStk.ccodprod::char(20),vrwStk.ctipmov::char(1));
end loop;
-- Generar Asientos contables de todos los registros cargados for vrwAsi in select idr.nidreg,nexpcon, a.cper from com_documento a inner join tmpNumnIdreg idr on a.iddocumento = idr.iddocumento where idr.nexpcon = 1 and a.es_con_migracion = 0 and trim(coalesce(a.obserror,'')) = '' loop --raise exception 'error pruebas '; perform com_importar_ventas_generaasiento(vrwAsi.cper::char(4), vrwAsi.nidreg::Integer);
end loop;
-- Actualizar correlativo en documento for vrcorre in select max(cnumero::integer) as nnumdoc,ccoddoc,cserie from com_documento group by ccoddoc,cserie loop
update cc_numdoc set nnumdoc=vrcorre.nnumdoc+1 where ccoddoc=vrcorre.ccoddoc and cserdoc=vrcorre.cserie and ctipmov='S';
end loop;
-- Confoirmacion update com_documento set resultado_migracion=1,obserror='registrado' where ccodmodulo='VENTA' AND es_con_migracion = 0 and trim(coalesce(obserror,'')) = '';
-- Validamos si en la carga existe registros Anulados perform com_importar_ventas_principal_Anular(); update com_documento set obserror='Anulación Existosa' where ccodmodulo='VENTA' and resultado_migracion=4; update com_documento set obserror='Documento no existe Anular/Eliminar' where ccodmodulo='VENTA' and resultado_migracion=5;
-- Manda cobranzas -------------------------------------------------------------------------------------------------------- perform com_importar_ventas_generaasiento_cobranza_principal(); -- Manda cobranzas --------------------------------------------------------------------------------------------------------
RETURN 1;
END; $BODY$ LANGUAGE 'plpgsql';

-- FUNCTION: public.com_importar_ventas_generaasiento(character, integer)

-- DROP FUNCTION IF EXISTS public.com_importar_ventas_generaasiento(character, integer);

CREATE OR REPLACE FUNCTION public.com_importar_ventas_generaasiento(
	vper character,
	vnidreg integer)
    RETURNS integer


AS $BODY$

DECLARE 
	rwemp record; 
	vctaigv char(20); 
	vctaicbper char(20); 
	vctaper char(20);
	vctaperd char(20); 
	vctaperh char(20);
	vctagan char(20);
	vctaIVAP char(20); 	

	/*
		select * from fin_importar_ventas_genasiento('2024'::char(4), 6968::integer) 

	 	select * from cc_registro order by nidreg desc limit 10
	*/

BEGIN
		-- Capuras las variables 
		vctaigv 	= ''; 
		vctaicbper 	= '';
		vctaper 	= '';		    
		vctaperd 	= '';  
		vctaperh 	= '';		    
		vctagan 	= '';	
		vctaIVAP 	= ''; 

		for rwemp in select cper,cctaigv,cctaicbper, cctaper, cctagan, civacue from cg_emppro where cper = vPer loop		

			    vctaigv 	= rwemp.cctaigv; 
				vctaicbper 	= rwemp.cctaicbper; 
			    vctaper 	= rwemp.cctaper;		    
			    vctaperd 	= (select cdesdeb from cf_plan where cper = rwemp.cper and ccodcue = rwemp.cctaper);  
			    vctaperh 	= (select cdeshab from cf_plan where cper = rwemp.cper and ccodcue = rwemp.cctaper);		    
			    vctagan 	= rwemp.cctagan;	
				vctaIVAP 	= rwemp.civacue;

		end loop; 

		if trim(coalesce(vctaigv,'')) <> '' then 			
			-- Funcion que genera asiento contable 
			perform  func_genera_asientonew(vnIdreg,vctaigv,vctaicbper,vctaper,vctaperd,vctaperh,vctagan,vctaIVAP,0); 

		end if; 

	RETURN 1; 
END; 
$BODY$
LANGUAGE 'plpgsql';

CREATE OR REPLACE FUNCTION public.com_importar_compras_ventas_principal_actualiza_stock_anula(
	periodo character varying,
	pmes character,
	pcodprod character,
	pctipmov character)
    RETURNS integer


AS $BODY$

	/*
	select * from com_importar_compras_ventas_principal_Actualiza_stock_Anula('2024'::character(4),
																				'10'::character(2),
																				'00000000KMM02'::character(20),
																				'I'::character(1))
	*/
declare 
	fila record;
	contador integer;
	unidades numeric (20, 10);
begin

if periodo = '' then
	return -1;
else
		--raise exception 'ccod sub % ', pmes; 
	for fila in	select Z.CPER, Z.MES,Z.CCODALMA, Z.CCODPROD, Z.CCODLOTE,
					SUM(case when NING is null then 0.0000000000 else NING end ) ning  , 
					SUM(case when nsal is null then 0.0000000000 else NSAL end ) nsal  
				FROM 
				( select r.cper, lpad(trim(to_char(EXTRACT(month FROM r.ffechaalm),'99')),2,'0')::varchar(2) as mes, rl.ccodalma, rl.ccodprod, RL.CCODLOTE,
							case when m.CTIPMOV = 'I' or (m.ctipmov = 'T' and (m.ctiptrans = '' or m.ctiptrans = 'I' or m.ctiptrans = 'B')) then
								(CASE WHEN (R.CCODDOC = '07' or  R.CCODDOC = '87' or  R.CCODDOC = '97')  THEN 
									sum(coalesce((rl.nuniori),0)) 
								ELSE 
									sum(coalesce(rl.nuniori*-1,0)) 
								END) 
							end as ning,			

							case when m.CTIPMOV = 'S' or (m.ctipmov = 'T' and (m.ctiptrans = '' or m.ctiptrans = 'S' or m.ctiptrans = 'A')) then 
									(CASE WHEN (R.CCODDOC = '07' or  R.CCODDOC = '87' or  R.CCODDOC = '97')  THEN 
										sum(coalesce((rl.nuniori),0)) 
									ELSE 
										sum(coalesce(rl.nuniori*-1,0)) 
									END) 
							end as nsal

					from com_detalledocumento rl 
					inner join com_documento r on rl.iddocumento = r.iddocumento
					inner join cc_movimiento m on r.ccodmov = m.ccodmov and m.ctipmov = pctipmov 
					where m.nafestock = 1 and m.nimpmon = 0 
							and r.es_con_migracion = 3 and r.resultado_migracion = 4 
							and lpad(trim(to_char(EXTRACT(year FROM r.ffechaalm),'9999')),4,'0')::varchar(4) = periodo 
							and lpad(trim(to_char(EXTRACT(month FROM r.ffechaalm),'99')),2,'0')::varchar(2) = pmes 
							and m.CTIPMOV in ('I','S','T') 
						    and rl.ccodprod = pCodprod
					group by r.cper, mes, rl.ccodalma, rl.ccodprod, RL.CCODLOTE, m.CTIPMOV, m.ctiptrans, r.ccoddoc
					order by  rl.ccodprod
				 ) as Z
				GROUP BY Z.CPER, Z.MES,Z.CCODALMA, Z,CCODPROD, Z.CCODLOTE
				ORDER BY Z.CPER, Z.MES,Z.CCODALMA, Z.CCODPROD

				loop

		--	Actualiza los stock  
		if pmes = '01' then
			if pctipmov = 'I' then 
				update cc_productoss set ning1 = ning1 + fila.ning where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			else 
				update cc_productoss set nsal1 = nsal1 + fila.nsal where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			end if; 
		end if;

		if pmes = '02' then
			if pctipmov = 'I' then 
				update cc_productoss set ning2 = ning2 + fila.ning where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			else 
				update cc_productoss set nsal2 = nsal2 + fila.nsal where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			end if; 
		end if;

		if pmes = '03' then
			if pctipmov = 'I' then 
				update cc_productoss set ning3 = ning3 + fila.ning where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			else 
				update cc_productoss set nsal3 = nsal3 + fila.nsal where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			end if; 
		end if;

		if pmes = '04' then
			if pctipmov = 'I' then
				update cc_productoss set ning4 = ning4 + fila.ning where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			else
				update cc_productoss set nsal4 = nsal4 + fila.nsal where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			end if; 
		end if;

		if pmes = '05' then
			if pctipmov = 'I' then
				update cc_productoss set ning5 = ning5 + fila.ning where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			else 
				update cc_productoss set nsal5 = nsal5 + fila.nsal where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			end if; 
		end if;

		if pmes = '06' then
			if pctipmov = 'I' then
				update cc_productoss set ning6 = ning6 + fila.ning where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			else 
				update cc_productoss set nsal6 = nsal6 + fila.nsal where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			end if; 
		end if;

		if pmes = '07' then
			if pctipmov = 'I' then
				update cc_productoss set ning7 = ning7 + fila.ning where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			else 
				update cc_productoss set nsal7 = nsal7 + fila.nsal where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			end if; 
		end if;

		if pmes = '08' then
			if pctipmov = 'I' then
				update cc_productoss set ning8 = ning8 + fila.ning where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			else 
				update cc_productoss set nsal8 = nsal8 + fila.nsal where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			end if; 
		end if;

		if pmes = '09' then
			if pctipmov = 'I' then
				update cc_productoss set ning9 = ning9 + fila.ning where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			else 
				update cc_productoss set nsal9 = nsal9 + fila.nsal where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			end if; 
		end if;


		if pmes = '10' then

			if pctipmov = 'I' then
				update cc_productoss set ning10 = ning10 + fila.ning where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			else 
				update cc_productoss set nsal10 = nsal10 + fila.nsal where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			end if; 
		end if;

		if pmes = '11' then

			if pctipmov = 'I' then
				update cc_productoss set ning11 = ning11 + fila.ning where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			else 
				update cc_productoss set nsal11 = nsal11 + fila.nsal where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			end if; 
		end if;

		if pmes = '12' then
			if pctipmov = 'I' then
				update cc_productoss set ning12 = ning12 + fila.ning where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			else 
				update cc_productoss set nsal12 = nsal12 - fila.nsal where cper = periodo and ccodalma = fila.ccodalma and ccodprod = fila.ccodprod;
			end if; 
		end if;

		-- Actualizar Ingresos en cc_productoslote		
		if pctipmov = 'I' then
			update cc_productoslote set nunilote = nunilote + (fila.ning) where cper = periodo and ccodprod = fila.ccodprod and ccodalma = fila.ccodalma and ccodlote = fila.ccodlote;
		else 
			update cc_productoslote set nunilote = nunilote - (fila.nsal) where cper = periodo and ccodprod = fila.ccodprod and ccodalma = fila.ccodalma and ccodlote = fila.ccodlote;
		end if; 

	end loop;

	return 1;	

end if;	
end; 
$BODY$
 LANGUAGE 'plpgsql';

CREATE OR REPLACE FUNCTION public.com_importar_ventas_principal_anular(
	)
    RETURNS integer
AS $BODY$

DECLARE 
	vnIdreg integer; 
	rw record; 
	rwAsi record; 
	vcper char(4);
	vcmes char(2);
	vccodori char(3);
	vnasiento integer; 
	rwctualizasubdiario record; 
	vccodprodAnula char(20); 
	vnidlin integer; 
	rwStk record; 
	/*
		select * from com_importar_ventas_principal_Anular() 
	*/
BEGIN
		select ccodprod into vccodprodAnula from cc_productos where nanuprod = 1 limit 1;  

		DROP TABLE IF EXISTS tmpDocumentosExistentes;
		DROP TABLE IF EXISTS tmpDocumentosNoExistentes;
		create temp table tmpDocumentosExistentes as 
		select a.iddocumento, a.cper, a.cmes, a.ccodruc, a.ccoddoc, a.cserie, a.cnumero,a.ccodrucanula, b.nidreg, 
				a.ccuecan, a.cdoccan,lpad(trim(a.csercan),20,'0') as csercan,lpad(trim(a.cnumcan),20,'0') as  cnumcan -- KMM - 25-04-2025 - LSQL-51
		from com_documento a
		left join cc_registro b on a.cper = b.cper and a.ccodruc = b.ccodruc and a.ccoddoc = b.ccoddoc and a.cserie = b.cserie and a.cnumero = b.cnumero 
		where a.es_con_migracion = 3 and coalesce(b.ccoddoc,'') <> ''; 

		create temp table tmpDocumentosNoExistentes as 
		select a.iddocumento,  a.cper, a.cmes, a.ccodruc, a.ccoddoc, a.cserie, a.cnumero,a.ccodrucanula, b.nidreg  
		from com_documento a
		left join cc_registro b on a.cper = b.cper and a.ccodruc = b.ccodruc and a.ccoddoc = b.ccoddoc and a.cserie = b.cserie and a.cnumero = b.cnumero 
		where a.es_con_migracion = 3 and coalesce(b.ccoddoc,'') = ''; 

		-- Eliminar documento y anular asientos 
		for rw in select iddocumento,nidreg, ccodrucanula, cper, cmes, ccodruc, ccoddoc, cserie, cnumero from tmpDocumentosExistentes loop 
			-- Buscar asiento 
			-- Buscar asiento 
		/*	update cf_diariol  set ccodruc = rw.ccodrucanula,
					   ndebe=0.00, nhaber=0.00, ndebes=0.00, nhabers=0.00, ndebed=0.00, 
					   nhaberd=0.00, nbase1=0.00, nigv1=0.00, nbase2=0.00, nigv2=0.00, 
					   nbase3=0.00, nigv3=0.00, nina=0.00, nexo=0.00, nisc=0.00, nivabase=0.00, nivaimp=0.00, 
					   ntot=0.00, nbase1s=0.00, nigv1s=0.00, nbase2s=0.00, nigv2s=0.00, nbase3s=0.00, 
					   nigv3s=0.00, ninas=0.00, nexos=0.00, niscs=0.00, nivabases=0.00, nivaimps=0.00, 
					   ntots=0.00, nbase1d=0.00, nigv1d=0.00, nbase2d=0.00, nigv2d=0.00, nbase3d=0.00, 
					   nigv3d=0.00, ninad=0.00, nexod=0.00, niscd=0.00, nivabased=0.00, nivaimpd=0.00, 
					   ntotd=0.00,cmesc='' 
			where cper = rw.cper and  ccodruc = rw.ccodruc and  ccoddoc = rw.ccoddoc and cserie  = rw.cserie and  cnumero = rw.cnumero; 


			select a.cper, a.cmes, a.ccodori, a.nasiento from cf_diariol a 
							inner join tmpDocumentosExistentes b on a.cper = b.cper and  a.ccodruc = b.ccodruc and  a.ccoddoc = b.cdoccan and a.cserie  = b.csercan and  a.cnumero = b.cnumcan 
							where a.cper = '2025'
							group by a.cper, a.cmes, a.ccodori, a.nasiento
			select * from tmpDocumentosExistentes


*/
			-- KMM - 25-04-2025 - LSQL-51
			for rwAsi in select a.cper, a.cmes, a.ccodori, a.nasiento from cf_diariol a 
							inner join tmpDocumentosExistentes b on a.cper = b.cper and  a.ccodruc = b.ccodruc and  a.ccoddoc = b.cdoccan and a.cserie  = b.csercan and  a.cnumero = b.cnumcan 
							where a.cper =  rw.cper  
							group by a.cper, a.cmes, a.ccodori, a.nasiento loop 

					delete from cf_diariol where cper = rwAsi.cper and cmes = rwAsi.cmes and  ccodori = rwAsi.ccodori and nasiento = rwAsi.nasiento  ;
					delete from cf_diario where cper = rwAsi.cper and cmes = rwAsi.cmes and  ccodori = rwAsi.ccodori and nasiento = rwAsi.nasiento  ;
			end loop; 
			-- KMM - 25-04-2025 - LSQL-51


			-- KMM - 14-04-2025 	
			for rwAsi in select a.cper, a.cmes, a.ccodori, a.nasiento from cf_diariol a 
							inner join tmpDocumentosExistentes b on a.cper = b.cper and  a.ccodruc = b.ccodruc and  a.ccoddoc = b.ccoddoc and a.cserie  = b.cserie and  a.cnumero = b.cnumero 
							where a.cper =  rw.cper 
							group by a.cper, a.cmes, a.ccodori, a.nasiento loop 
				update cf_diariol
				set ccodruc = rw.ccodrucanula,
					   ndebe=0.00, nhaber=0.00, ndebes=0.00, nhabers=0.00, ndebed=0.00, 
					   nhaberd=0.00, nbase1=0.00, nigv1=0.00, nbase2=0.00, nigv2=0.00, 
					   nbase3=0.00, nigv3=0.00, nina=0.00, nexo=0.00, nisc=0.00, nivabase=0.00, nivaimp=0.00, 
					   ntot=0.00, nbase1s=0.00, nigv1s=0.00, nbase2s=0.00, nigv2s=0.00, nbase3s=0.00, 
