					   ntots=0.00, nbase1d=0.00, nigv1d=0.00, nbase2d=0.00, nigv2d=0.00, nbase3d=0.00, 
					   nigv3d=0.00, ninad=0.00, nexod=0.00, niscd=0.00, nivabased=0.00, nivaimpd=0.00, 
					   ntotd=0.00, cmesc=''
				where cper = rwAsi.cper and cmes = rwAsi.cmes and  ccodori = rwAsi.ccodori and nasiento = rwAsi.nasiento  ;

			end loop; 
			-- KMM - 14-04-2025 

			raise notice 'eliminando % ', rw.nidreg;		

			-- Anular en el comercial 
			update cc_registro set ccodruc = rw.ccodrucanula,  
					nbase1=0.00, nigv1=0.00, nbase2=0.00, nigv2=0.00, nbase3=0.00, nigv3=0.00, nina=0.00, nexo=0.00, 
					nisc=0.00, nivabase=0.00, nivaimp=0.00, nimpant=0.00, ntot=0.00, nbase1s=0.00, nigv1s=0.00, nbase2s=0.00, nigv2s=0.00, nbase3s=0.00, 
					nigv3s=0.00, ninas=0.00, nexos=0.00, niscs=0.00, nivabases=0.00, nivaimps=0.00, ntots=0.00, ndifajuss=0.00, nbase1d=0.00, nigv1d=0.00, 
					nbase2d=0.00, nigv2d=0.00, nbase3d=0.00, nigv3d=0.00, ninad=0.00, nexod=0.00, niscd=0.00, nivabased=0.00, nivaimpd=0.00, ntotd=0.00,
					ccodusumod='ADMIN',tfechasismod=current_timestamp, cestadodoc='A'
			where nidreg = rw.nidreg; 

			-- detalle 
			select nidlin into vnidlin from cc_registrol where nidreg = rw.nidreg limit 1;
			delete from cc_registrol where nidreg = rw.nidreg and nidlin <> vnidlin;
			update cc_registrol 
				set ccodprod= vccodprodAnula, cdesprod='ANULADO',nuniori=0.00, 
					nvvori=0.00, npvori=0.00, ntotori=0.00, npigv=0.00, ncolreg=0.00, nvalor=0.00, 
					nigvtot=0.00, ccodmed=0.00, nconvnum=0.00, nconvden=0.00, nunikar=0.00, npukar=0.00, 
					ntotkar=0.00, nvvoris=0.00, npvoris=0.00, ntotoris=0.00, nvvorid=0.00, npvorid=0.00, 
					ntotorid=0.00, nvalors=0.00, nigvtots=0.00, ndifajuss=0.00, nvalord=0.00, nigvtotd=0.00, 
					ndifajusd=0.00, npukars=0.00, ntotkars=0.00, npukard=0.00, ntotkard=0.00 
			where nidreg = rw.nidreg; 

			-- Actualiza documento eliminado correctamente 
			update com_documento set resultado_migracion = 4  where iddocumento = rw.iddocumento; 

		end loop; 

		-- Actualizar stock en y en lotes 
		for rwStk in select ar.nidreg, ar.cper, ar.cmes, a.ccodprod,m.ctipmov 
							from com_detalledocumento a
							inner join tmpDocumentosExistentes ar on a.iddocumento = ar.iddocumento
							inner join com_documento r on ar.iddocumento = r.iddocumento
							inner join cc_movimiento m on r.ccodmov = m.ccodmov and m.ctipmov = 'S'
							where m.nafestock = 1 and m.nimpmon = 0 
								  and r.es_con_migracion = 3 and r.resultado_migracion = 4 loop 

			perform com_importar_compras_ventas_principal_Actualiza_stock_Anula(rwStk.cper::char(4),rwStk.cmes::char(2),rwStk.ccodprod::char(20),rwStk.ctipmov::char(1));

		end loop; 

		-- Actualiza los documentos no existentes 
		 update  com_documento set obserror='Documento no existe para Anular/ Eliminar.', resultado_migracion = 5   
		 where iddocumento in ( select iddocumento from tmpDocumentosNoExistentes);	

		-- Actualiza subdianrtiops 
		for rwctualizasubdiario  in select distinct cper,cmes  from tmpDocumentosExistentes loop
			perform func_regenerar_correlativo_subdiario(rwctualizasubdiario.cper, rwctualizasubdiario.cmes); 
			perform func_regenerar_saldos_plan_flujo(rwctualizasubdiario.cper, rwctualizasubdiario.cmes); 
		end loop;	

	return 1; 

END; 
